INSERT INTO `aboutus` (`id`, `aboutus`, `department`) VALUES
(1, '<div><div><span source="" sans="" pro",="" "lucida="" unicode",="" grande",="" sans-serif;="" font-size:="" 14px;="" text-align:="" justify;"="">Electrical Engineering is a field of engineering that generally deals with the study and application of electricity, electronics, and electromagnetism. This field first became an identifiable occupation in the latter half of the 19th century after commercialization of the electric telegraph, the telephone, and electric power distribution and use. Subsequently, broadcasting and recording media made electronics part of daily life. The invention of the transistor, and later the integrated circuit, brought down the cost of electronics to the point they can be used in almost any household object.</span><br source="" sans="" pro",="" "lucida="" unicode",="" grande",="" sans-serif;="" font-size:="" 14px;="" text-align:="" justify;"=""><br source="" sans="" pro",="" "lucida="" unicode",="" grande",="" sans-serif;="" font-size:="" 14px;="" text-align:="" justify;"=""><span source="" sans="" pro",="" "lucida="" unicode",="" grande",="" sans-serif;="" font-size:="" 14px;="" text-align:="" justify;"="">Electrical engineering has now subdivided into a wide range of subfields including electronics, digital computers, power engineering, telecommunications, control systems, radio-frequency engineering, signal processing, instrumentation, and microelectronics. The subject of electronic engineering is often treated as its own subfield but it intersects with all the other subfields, including the power electronics of power engineering.</span><br source="" sans="" pro",="" "lucida="" unicode",="" grande",="" sans-serif;="" font-size:="" 14px;="" text-align:="" justify;"=""><br source="" sans="" pro",="" "lucida="" unicode",="" grande",="" sans-serif;="" font-size:="" 14px;="" text-align:="" justify;"=""><span source="" sans="" pro",="" "lucida="" unicode",="" grande",="" sans-serif;="" font-size:="" 14px;="" text-align:="" justify;"="">Electrical engineers typically hold a degree in electrical engineering or electronic engineering. Practicing engineers may have professional certification and be members of a professional body. Such bodies include the Institute of Electrical and Electronics Engineers (IEEE) and the Institution of Engineering and Technology (professional society) (IET).</span><br source="" sans="" pro",="" "lucida="" unicode",="" grande",="" sans-serif;="" font-size:="" 14px;="" text-align:="" justify;"=""><br source="" sans="" pro",="" "lucida="" unicode",="" grande",="" sans-serif;="" font-size:="" 14px;="" text-align:="" justify;"=""><span source="" sans="" pro",="" "lucida="" unicode",="" grande",="" sans-serif;="" font-size:="" 14px;="" text-align:="" justify;"="">Electrical engineers work in a very wide range of industries and the skills required are likewise variable. These range from basic circuit theory to the management skills required of a project manager. The tools and equipment that an individual engineer may need are similarly variable, ranging from a simple voltmeter to a top end analyzer to sophisticated design and manufacturing software.</span></div><span style="font-size: 24px;"><u><span style="font-weight: 700;"><br>VISION:</span></u></span><span style="font-size: 18px;"><br>To develop competent electrical graduates in society.</span><span style="font-size: 24px;"><br><br><u><span style="font-weight: 700;">MISSION:</span></u></span><span style="font-size: 18px;"><br>M1. To produce electrical graduates with high technical skills.<br>M2. To incorporate innovative things in learning environment incompetence with industry&nbsp;needs.<br>M3. To create research oriented mindset and focus in fulfilling growing demand of society&nbsp;through mentoring and motivation.</span><span style="font-size: 24px;"><br><br><span style="font-weight: 700;"><u>Program Education Objectives (PEOs):</u></span></span><span style="font-size: 18px;"><br>PEO1: To build a strong foundation in the students in Mathematics, Science and Engineering&nbsp;fundamentals so as to enable them apply the same to analyze, design, innovate and&nbsp;develop products for real life applications.<br>PEO2: To foster and imbibe values and ethics, positive attitude, effective communication&nbsp;skills, leadership qualities and team spirit for a rewarding personal and professional&nbsp;career with a deep commitment and concern for the society.<br>PEO3: To provide a holistic academic environment befitting research, academic excellence,&nbsp;entrepreneurship and desire for creating new knowledge so as to become industry and&nbsp;professionally ready to meet global challenges.</span></div><div><span style="font-size: 18px;"><br></span></div><div><h2 style="font-family: " source="" sans="" pro",="" "lucida="" unicode",="" grande",="" sans-serif;="" font-weight:="" 700;="" line-height:="" 40px;="" color:="" rgb(49,="" 51,="" 56);="" margin-right:="" 0px;="" margin-bottom:="" margin-left:="" padding-bottom:="" 10px;="" text-align:="" justify;"="">Program Outcomes (POs)</h2><div>Engineering Graduates will be able to:<br></div><ul style="margin-top: 0px; font-family: " source="" sans="" pro",="" "lucida="" unicode",="" grande",="" sans-serif;="" font-size:="" 14px;="" text-align:="" justify;="" padding-left:="" 20px;"=""><li><b>Engineering knowledge:</b>&nbsp;Apply the knowledge of mathematics, science, engineering fundamentals, and an engineering specialization to the solution of complex engineering problems.<br><br></li><li><b>Problem analysis:</b>&nbsp;Identify, formulate, review research literature, and analyze complex engineering problems reaching substantiated conclusions using first principles of mathematics, natural sciences, and engineering sciences.<br><br></li><li><b>Design/development of solutions:</b>&nbsp;Design solutions for complex engineering problems and design system components or processes that meet the specified needs with appropriate consideration for the public health and safety, and the cultural, societal, and environmental considerations.<br><br></li><li><b>Conduct investigations of complex problems:</b>&nbsp;Use research-based knowledge and research methods including design of experiments, analysis and interpretation of data, and synthesis of the information to provide valid conclusions.<br><br></li><li><b>Modern tool usage:</b>&nbsp;Create, select, and apply appropriate techniques, resources, and modern engineering and IT tools including prediction and modeling to complex engineering activities with an understanding of the limitations.<br><br></li><li><b>The engineer and society:</b>&nbsp;Apply reasoning informed by the contextual knowledge to assess societal, health, safety, legal and cultural issues and the consequent responsibilities relevant to the professional engineering practice.<br><br></li><li><b>Environment and sustainability:</b>&nbsp;Understand the impact of the professional engineering solutions in societal and environmental contexts, and demonstrate the knowledge of, and need for sustainable development.<br><br></li><li><b>Ethics:</b>&nbsp;Apply ethical principles and commit to professional ethics and responsibilities and norms of the engineering practice.<br><br></li><li><b>Individual and team work:</b>&nbsp;Function effectively as an individual, and as a member or leader in diverse teams, and in multidisciplinary settings.<br><br></li><li><b>Communication:</b>&nbsp;Communicate effectively on complex engineering activities with the engineering community and with society at large, such as, being able to comprehend and write effective reports and design documentation, make effective presentations, and give and receive clear instructions.<br><br></li><li><b>Project management and finance:</b>&nbsp;Demonstrate knowledge and understanding of the engineering and management principles and apply these to one’s own work, as a member and leader in a team, to manage projects and in multidisciplinary environments.<br><br></li><li><b>Life-long learning:</b>&nbsp;Recognize the need for, and have the preparation and ability to engage in independent and life-long learning in the broadest context of technological change.</li></ul><div style="text-align: justify;"><font face="Source Sans Pro, Lucida Sans Unicode, Lucida Grande, sans-serif"><span style="font-size: 14px;"><br></span></font></div></div><div style="text-align: justify;"><b>Program Specific Outcomes (PSOs)&nbsp;</b></div><div style="text-align: justify;"><b><br></b></div><div style="text-align: justify;"><b>PSO1</b>: Graduates will have the ability to remember and understand the basic concept of electrical and \r\nelectronic engineering, computer programming, design and analysis of different electrical and \r\nelectronics network, basic Sciences and knowledge of mathematics.&nbsp;</div><div style="text-align: justify;"><br></div><div style="text-align: justify;"><b>PSO2</b>: Graduates will have knowledge of principles, design and performance &amp; testing of static &amp; \r\ndynamic parts of electrical energy system.&nbsp;</div><div style="text-align: justify;"><br></div><div style="text-align: justify;"><b>PSO3</b>: Graduates will gain knowledge and acquire skills for analysis, operation, control and protection of \r\nelectrical power system for generation, transmission, distribution &amp; utilization.&nbsp;</div><div style="text-align: justify;"><br></div><div style="text-align: justify;"><b>PSO4</b>: Graduates will gain knowledge of instrumentation, control &amp; automation and power electronics \r\napplicable in core and related fields</div><div style="text-align: justify;"><br></div><div><span style="font-size: 24px;"></span></div>', 'F'),
(2, '<div><div><b><span lang="EN-IN" style="margin: 0px; padding: 0px; list-style: none; font-size: 14pt; line-height: 28px; color: black; font-family: " times="" new="" roman",="" times,="" serif;"="">TECHNICAL EDUCATION QUALITY IMPROVEMENT PROGRAMME(TEQIP-III)</span></b><br><b><span lang="EN-IN" style="margin: 0px; padding: 0px; list-style: none; font-size: 14pt; line-height: 28px; color: black; font-family: " times="" new="" roman",="" times,="" serif;"="">(GOVERNMENT OF INDIA)</span></b><b><span lang="EN-IN" style="margin: 0px; padding: 0px; list-style: none; font-size: 12pt; line-height: 24px; color: black;"><o:p></o:p></span></b></div><div><b><span lang="EN-IN" style="margin: 0px; padding: 0px; list-style: none; font-size: 12pt; line-height: 24px; color: black;"><br><span style="margin: 0px; padding: 0px; list-style: none; font-family: " times="" new="" roman",="" times,="" serif;="" font-size:="" 14pt;"="">A WORLD BANK FUNDED PROJECT</span><o:p></o:p></span></b></div><div><span lang="EN-IN" style="margin: 0px; padding: 0px; list-style: none; font-size: 12pt; line-height: 24px; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="margin: 0px; padding: 0px; list-style: none; font-family: " times="" new="" roman",="" times,="" serif;="" font-size:="" 14pt;"="">The Project, Third phase of Technical Education Quality Improvement Programme (referred to as TEQIP-III) is fully integrated with the Twelveth Five-year Plan objectives for Technical Education as a key component for improving the quality of Engineering Education in existing institutions with a special consideration for Low Income States and Special Category States (SCS) and support to strengthen few affiliated technical universities to improve their policy, academic and management practices.&nbsp;</span><o:p></o:p></span></div><div><b><span lang="EN-IN" style="margin: 0px; padding: 0px; list-style: none; font-size: 12pt; line-height: 24px; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="margin: 0px; padding: 0px; list-style: none; font-family: " times="" new="" roman",="" times,="" serif;="" font-size:="" 14pt;"="">TEQIP-III:Project Objectives</span><o:p></o:p></span></b></div><div><span lang="EN-IN" style="margin: 0px; padding: 0px; list-style: none; font-size: 12pt; line-height: 24px; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="margin: 0px; padding: 0px; list-style: none; font-family: " times="" new="" roman",="" times,="" serif;="" font-size:="" 14pt;"="">The Project will focus on the following objectives:</span><o:p></o:p></span></div><div><span lang="EN-IN" style="margin: 0px; padding: 0px; list-style: none; font-size: 12pt; line-height: 24px; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="margin: 0px; padding: 0px; list-style: none; font-family: " times="" new="" roman",="" times,="" serif;="" font-size:="" 14pt;"="">Improving quality and equity in engineering institutions in focus states viz. 7 Low Income States (LIS), eightstates in the North-East of India, three Hill states viz. Himachal Pradesh,Jammu &amp; Kashmir, Uttarakhand and Andaman and Nicobar Islands (a union territory (UT))</span><o:p></o:p></span></div><div><span lang="EN-IN" style="margin: 0px; padding: 0px; list-style: none; font-size: 12pt; line-height: 24px; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="margin: 0px; padding: 0px; list-style: none; font-family: " times="" new="" roman",="" times,="" serif;="" font-size:="" 14pt;"="">System-level initiatives to strengthen sector governance and performance which include widening the scope of Affiliating Technical Universities (ATUs) to improve their policy, academic and management practices towards affiliated institutions, and</span><o:p></o:p></span></div><div><span lang="EN-IN" style="margin: 0px; padding: 0px; list-style: none; font-size: 12pt; line-height: 24px; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="margin: 0px; padding: 0px; list-style: none; font-family: " times="" new="" roman",="" times,="" serif;="" font-size:="" 14pt;"="">Twinning Arrangements to Build Capacity and Improve Performance of institutions and ATUs participating infocus states.</span><o:p></o:p></span></div><div><b><span lang="EN-IN" style="margin: 0px; padding: 0px; list-style: none; font-size: 12pt; line-height: 24px; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="margin: 0px; padding: 0px; list-style: none; font-family: " times="" new="" roman",="" times,="" serif;="" font-size:="" 14pt;"="">TEQIP-III:Project Scope</span><o:p></o:p></span></b></div><div><span lang="EN-IN" style="margin: 0px; padding: 0px; list-style: none; font-size: 12pt; line-height: 24px; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="margin: 0px; padding: 0px; list-style: none; font-family: " times="" new="" roman",="" times,="" serif;="" font-size:="" 14pt;"="">Only the Government and Government aided AICTE approved Engineering institutions/Engineering faculty/Engineering Teaching Department/Constituent Institutions of Universities/Deemed to be Universities and new centrally funded institutions in SCS will be the part of the project.&nbsp;An estimated 200 Government and Government funded Engineering institutions including Affiliating Technical Universities (ATUs) will be selected under different sub-components in one or two cycles.</span><o:p></o:p></span></div><div><b><span lang="EN-IN" style="margin: 0px; padding: 0px; list-style: none; font-size: 12pt; line-height: 24px; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="margin: 0px; padding: 0px; list-style: none; font-family: " times="" new="" roman",="" times,="" serif;="" font-size:="" 14pt;"="">Sub-component 1.3 : TwinningArrangements to Build Capacity and Improve Performance of ParticipatingInstitutions and ATUs</span><o:p></o:p></span></b></div><div><span lang="EN-IN" style="margin: 0px; padding: 0px; list-style: none; font-size: 14pt; line-height: 28px; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: " times="" new="" roman",="" times,="" serif;"="">Institutions (alreadyparticipated in TEQIP-I and/or II)/ATUs will be selected on a competitive basisthrough Challenge Method. Selection will proceed in 3 stages. At the first stage, Eligibility criteria will be used to shortlist the TEQIP-I/TEQIP-IIinstitutes/ Universities followed by ranking on the basis of their performanceassessment. Top rankers from stage-1 will be invited to submit InstitutionDevelopment Proposals (IDPs) in stage-2. The institutions will proceed to stage3 for final selection. The proposal should include establishing a mentoringsystem for twinning arrangements to build the capacity and improvement inperformance of institution/ATUs participating under sub-component 1.1/1.2respectively.&nbsp;<br>Institutions are required to define the activities in their IDP that they wantto carry out in the project. These activities should be under the scope of theproject and are those that fulfil the objectives of the project. However, someof the suggested activities under the scope of the project are given below:</span><span lang="EN-IN" style="margin: 0px; padding: 0px; list-style: none; font-size: 12pt; line-height: 24px; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><o:p></o:p></span></div><ul type="disc" style="margin: 0px; padding: 0px; list-style: none; font-family: " helvetica="" neue",="" helvetica,="" arial,="" sans-serif;="" font-size:="" 14px;"=""><span style="margin: 0px; padding: 0px; list-style: none; font-family: " times="" new="" roman",="" times,="" serif;="" font-size:="" 14pt;"=""></span><li class="MsoNormal" style="margin: 0px; padding: 0px; list-style: none; color: black; text-align: justify; line-height: 21px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span lang="EN-IN" style="margin: 0px; padding: 0px; list-style: none; font-size: 12pt; line-height: 24px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="margin: 0px; padding: 0px; list-style: none; font-family: " times="" new="" roman",="" times,="" serif;="" font-size:="" 14pt;"="">Procurement of Goods (equipment, furniture, books LRs, software and minor items) and minor civil works</span><o:p></o:p></span></li><span style="margin: 0px; padding: 0px; list-style: none; font-family: " times="" new="" roman",="" times,="" serif;="" font-size:="" 14pt;"=""></span><li class="MsoNormal" style="margin: 0px; padding: 0px; list-style: none; color: black; text-align: justify; line-height: 21px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span lang="EN-IN" style="margin: 0px; padding: 0px; list-style: none; font-size: 12pt; line-height: 24px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="margin: 0px; padding: 0px; list-style: none; font-family: " times="" new="" roman",="" times,="" serif;="" font-size:="" 14pt;"="">Improvement in Teaching, Learning and Research competence</span><o:p></o:p></span></li><span style="margin: 0px; padding: 0px; list-style: none; font-family: " times="" new="" roman",="" times,="" serif;="" font-size:="" 14pt;"=""></span><ul type="circle" style="margin: 0px; padding: 0px; list-style: none;"><span style="margin: 0px; padding: 0px; list-style: none; font-family: " times="" new="" roman",="" times,="" serif;="" font-size:="" 14pt;"=""></span><li class="MsoNormal" style="margin: 0px; padding: 0px; list-style: none; color: black; text-align: justify; line-height: 21px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span lang="EN-IN" style="margin: 0px; padding: 0px; list-style: none; font-size: 12pt; line-height: 24px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="margin: 0px; padding: 0px; list-style: none; font-family: " times="" new="" roman",="" times,="" serif;="" font-size:="" 14pt;"="">Improve student learning</span><o:p></o:p></span></li><span style="margin: 0px; padding: 0px; list-style: none; font-family: " times="" new="" roman",="" times,="" serif;="" font-size:="" 14pt;"=""></span><li class="MsoNormal" style="margin: 0px; padding: 0px; list-style: none; color: black; text-align: justify; line-height: 21px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span lang="EN-IN" style="margin: 0px; padding: 0px; list-style: none; font-size: 12pt; line-height: 24px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="margin: 0px; padding: 0px; list-style: none; font-family: " times="" new="" roman",="" times,="" serif;="" font-size:="" 14pt;"="">Student employability</span><o:p></o:p></span></li><span style="margin: 0px; padding: 0px; list-style: none; font-family: " times="" new="" roman",="" times,="" serif;="" font-size:="" 14pt;"=""></span><li class="MsoNormal" style="margin: 0px; padding: 0px; list-style: none; color: black; text-align: justify; line-height: 21px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span lang="EN-IN" style="margin: 0px; padding: 0px; list-style: none; font-size: 12pt; line-height: 24px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="margin: 0px; padding: 0px; list-style: none; font-family: " times="" new="" roman",="" times,="" serif;="" font-size:="" 14pt;"="">Increasing faculty productivity and motivation</span><o:p></o:p></span></li><span style="margin: 0px; padding: 0px; list-style: none; font-family: " times="" new="" roman",="" times,="" serif;="" font-size:="" 14pt;"=""></span><li class="MsoNormal" style="margin: 0px; padding: 0px; list-style: none; color: black; text-align: justify; line-height: 21px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span lang="EN-IN" style="margin: 0px; padding: 0px; list-style: none; font-size: 12pt; line-height: 24px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="margin: 0px; padding: 0px; list-style: none; font-family: " times="" new="" roman",="" times,="" serif;="" font-size:="" 14pt;"="">Establishing a twinning system</span><o:p></o:p></span></li><span style="margin: 0px; padding: 0px; list-style: none; font-family: " times="" new="" roman",="" times,="" serif;="" font-size:="" 14pt;"=""></span><ul type="square" style="margin: 0px; padding: 0px; list-style: none;"><span style="margin: 0px; padding: 0px; list-style: none; font-family: " times="" new="" roman",="" times,="" serif;="" font-size:="" 14pt;"=""></span><li class="MsoNormal" style="margin: 0px; padding: 0px; list-style: none; color: black; text-align: justify; line-height: 21px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span lang="EN-IN" style="margin: 0px; padding: 0px; list-style: none; font-size: 12pt; line-height: 24px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="margin: 0px; padding: 0px; list-style: none; font-family: " times="" new="" roman",="" times,="" serif;="" font-size:="" 14pt;"="">Twinning arrangements with institutions under Sub-component 1.1 to build capacity and improved performance</span><o:p></o:p></span></li><span style="margin: 0px; padding: 0px; list-style: none; font-family: " times="" new="" roman",="" times,="" serif;="" font-size:="" 14pt;"=""></span><li class="MsoNormal" style="margin: 0px; padding: 0px; list-style: none; color: black; text-align: justify; line-height: 21px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span lang="EN-IN" style="margin: 0px; padding: 0px; list-style: none; font-size: 12pt; line-height: 24px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="margin: 0px; padding: 0px; list-style: none; font-family: " times="" new="" roman",="" times,="" serif;="" font-size:="" 14pt;"="">Individual Institutional mentors</span><o:p></o:p></span></li><span style="margin: 0px; padding: 0px; list-style: none; font-family: " times="" new="" roman",="" times,="" serif;="" font-size:="" 14pt;"=""></span></ul><span style="margin: 0px; padding: 0px; list-style: none; font-family: " times="" new="" roman",="" times,="" serif;="" font-size:="" 14pt;"=""></span></ul></ul><div><i><span lang="EN-IN" style="margin: 0px; padding: 0px; list-style: none; font-size: 14pt; line-height: 28px; color: rgb(65, 65, 65); font-family: " times="" new="" roman",="" times,="" serif;"="">(Consultantservices if required, can also be procured for the above said activities.)</span></i></div></div>', 'W'),
(3, '<div style="text-align: justify;"><span style="font-size: 14pt; line-height: 115%; font-family: " times="" new="" roman",="" serif;"=""><span style="font-size:18px;"><b>Civil engineering</b> is a professional engineering discipline that deals with the design, construction, and maintenance of the physical and naturally built environment, including works like roads, bridges, canals, dams, and buildings.&nbsp;</span></span><span style="font-size: 14pt; line-height: 115%; font-family: " times="" new="" roman",="" serif;="" color:="" rgb(68,="" 68,="" 68);="" background-image:="" initial;="" background-position:="" background-size:="" background-repeat:="" background-attachment:="" background-origin:="" background-clip:="" initial;"="">Engineering College, Ajmer was\r\nestablished in 1997 and the Civil Engineering Department is part of the\r\ninstitute <b>since 2011</b></span><span style="font-size: 14pt; line-height: 115%; font-family: " times="" new="" roman",="" serif;"=""> with AICTE sanctioned strength 75 <i>(60+12+3)</i> students in UG\r\nprogram.</span><span style="font-size: 14pt; line-height: 115%; font-family: " times="" new="" roman",="" serif;="" color:="" rgb(68,="" 68,="" 68);="" background-image:="" initial;="" background-position:="" background-size:="" background-repeat:="" background-attachment:="" background-origin:="" background-clip:="" initial;"=""> The Department has grown tremendously over the\r\nyears and is now recognized as one of the major engineering departments. The\r\nDepartment of Civil Engineering with its multifaceted faculty continues to\r\nmaintain and cultivate its strong links with the infrastructural industry and\r\nacademic and research institutions both within and outside the country.</span><o:p></o:p></div>\r\n\r\n<div style="text-align: justify;"><b><span style="font-size: 14pt; line-height: 115%; font-family: " times="" new="" roman",="" serif;"=""><br></span></b></div><div style="text-align: justify;"><b><span style="font-size: 14pt; line-height: 115%; font-family: " times="" new="" roman",="" serif;"="">VISION</span></b></div>\r\n\r\n<div style="text-align: justify;"><span style="font-size: 14pt; line-height: 115%; font-family: " times="" new="" roman",="" serif;"="">Entrusted by society\r\nand industry to foster a sustainable world by making competent and ethically\r\nstrong Civil Engineers.<o:p></o:p></span></div>\r\n\r\n<div style="text-align: justify;"><span style="font-size: 14pt; line-height: 115%; font-family: " times="" new="" roman",="" serif;"="">&nbsp;<o:p></o:p></span></div>\r\n\r\n<div style="text-align: justify;"><b><span style="font-size:14.0pt;line-height:115%;font-family:" times="" new="" roman","serif";="" mso-fareast-font-family:"times="" roman";color:#003300"="">MISSION</span></b></div>\r\n\r\n<div style="text-align: justify;"><span style="font-size:14.0pt;line-height:115%;font-family:" times="" new="" roman","serif";="" mso-fareast-font-family:"times="" roman";color:#003300"="">1</span><span style="font-size: 14pt; line-height: 115%; font-family: " times="" new="" roman",="" serif;"="">) To impart quality\r\neducation to prepare competitive undergraduate students for a successful career\r\nin civil engineering<o:p></o:p></span></div>\r\n\r\n<div style="text-align: justify;"><span style="font-size: 14pt; line-height: 115%; font-family: " times="" new="" roman",="" serif;"="">2) To impart soft\r\nskills, leadership qualities and professional ethics among the graduates to\r\nhandle projects independently.<o:p></o:p></span></div>\r\n\r\n<div style="text-align: justify;"><span style="font-size: 14pt; line-height: 115%; font-family: " times="" new="" roman",="" serif;"="">3) To promote\r\ninnovative thinking in the minds of promising engineers to face the future\r\nchallenges for an evolving sustainable world.<o:p></o:p></span></div>\r\n\r\n<div style="text-align: justify;"><span style="font-size: 14pt; line-height: 115%; font-family: " times="" new="" roman",="" serif;"="">&nbsp;</span></div>\r\n\r\n<div style="text-align: justify;"><div><b><span style="font-size: 18pt; line-height: 107%; font-family: " times="" new="" roman",="" serif;="" color:="" rgb(49,="" 49,="" 49);="" background-image:="" initial;="" background-position:="" background-size:="" background-repeat:="" background-attachment:="" background-origin:="" background-clip:="" initial;"="">Program Outcomes of Civil Engineering Graduate\r\n(PO’S)<o:p></o:p></span></b></div>\r\n\r\n<div><b><span style="font-size: 18pt; line-height: 107%; font-family: " times="" new="" roman",="" serif;="" color:="" rgb(49,="" 49,="" 49);="" background-image:="" initial;="" background-position:="" background-size:="" background-repeat:="" background-attachment:="" background-origin:="" background-clip:="" initial;"=""><o:p>&nbsp;</o:p></span></b></div>\r\n\r\n<ol>\r\n <li><span style="font-size:18px;"><u>Engineering Knowledge:</u> Apply the knowledge of mathematics, science, engineering fundamentals, and an engineering specialization to the solution of complex engineering problems.</span></li><li><span style="font-size:18px;"><u>\r\nProblem Analysis:</u> Identify, formulate, review research literature, and analyze complex engineering problems reaching substantiated conclusions using first principles of mathematics, natural sciences, and engineering sciences.</span></li><li><span style="font-size:18px;">\r\nD<u>esign/development of solutions</u>: Design solutions for complex engineering problems and design system components or processes that meet the specified needs with appropriate consideration for the public health and safety, and the cultural,&nbsp;and environmental considerations.</span></li><li><span style="font-size:18px;"><u>\r\nConduct investigations of complex problems</u>: Use research-based knowledge and research methods including design of experiments, analysis and interpretation of data, and synthesis of the information to provide valid conclusions.</span></li><li><span style="font-size:18px;"><u>\r\nModern tool usage:</u> Create, select, and apply appropriate techniques, resources, and modern engineering and IT tools including prediction and modeling to complex engineering activities with an understanding of the limitations.</span></li><li><span style="font-size:18px;"><u>\r\nThe engineer and society</u>: Apply reasoning informed by the contextual knowledge to assess societal, health, safety, legal and cultural issues and the consequent responsibilities relevant to the professional engineering practice.</span></li><li><span style="font-size:18px;"><u>\r\nEnvironment and sustainability</u>: Understand the impact of the professional engineering solutions in societal and environmental contexts, and demonstrate the knowledge of, and need for sustainable development.</span></li><li><span style="font-size:18px;"><u>\r\nEthics</u>: Apply ethical principles and commit to professional ethics and responsibilities and norms of the engineering practice.</span></li><li><span style="font-size:18px;">\r\nIndividual and team work: Function effectively as an individual, and as a member or leader in diverse teams, and in multidisciplinary settings.</span></li><li><span style="font-size:18px;"><u>\r\nCommunication</u>: Communicate effectively on complex engineering activities with the engineering community and with society at large, such as, being able to comprehend and write effective reports and design documentation, make effective&nbsp;Presentations, and give and receive clear instructions.</span></li><li><span style="font-size:18px;"><u>\r\nProject management and finance</u>: Demonstrate knowledge and understanding of the engineering and management principles and apply these to one’s own work, as a member and leader in a team, to manage projects and in multidisciplinary Environments.</span></li><li><span style="font-size:18px;"><u>\r\nLife-long learning: </u>Recognize the need for, and have the preparation and ability to engage in independent and life-long learning in the broadest context of technological change.</span></li></ol><span style="font-size:18px;">\r\n&nbsp;<br><b>\r\nProgram Specific Outcomes (PSOs)</b><br>\r\nPSO 1 Graduates shall have the ability of critical thinking based on in depth knowledge of Civil Engineering to obtain optimal solutions to complex problems.<br>\r\nPSO 2 Graduates shall be able to plan and supervise various construction activities in a sustainable way for completion of various projects satisfactorily.<br>\r\nPSO 3 Graduates shall imbibe ethical practices and social responsibility in their professional endure.&nbsp;</span><div><span style="font-size:12.0pt;line-height:107%;font-family:" times="" new="" roman",serif"=""><o:p></o:p></span></div></div>', 'C'),
(4, '<div><a href="http://ecajmer.ac.in/EICDept#" target="_blank">Newsletters/ magazine</a><br></div>', 'E'),
(5, '<div>EAP TEQIP-III Engineering College Ajmer</div>', '11'),
(6, '<div style="text-align: justify;">The Examination Cell of Engineering College Ajmer is committed to conduct the University examinations of both the affiliating Universities (Rajasthan Technical University, Kota and Bikaner Technical University, Bikaner) in an environment that promotes highest academic standards and nourishes ethical values. Supported by a committed team of faculty members and non-teaching staff, examinations are conducted every year smoothly. We at examination cell strive hard so that the proper information flow to the students is ensured. We are open to suggestions to make this important activity of conduction of examinations in a better way.&nbsp;</div>', 'M'),
(7, '<div style="text-align: justify;"><span class="tm6">Of all the living beings, man is be more rational and developed. Through individual and collective attempts he has created a historical and cultural space which not only influences his\r\nsurroundings but also the generations to come. And, simultaneously he has acquired a mental equilibrium to understand the relationship between him and other living creatures including nature.</span></div><div style="text-align: justify;"><span class="tm6"><br></span></div>\r\n<div style="text-align: justify;"><span class="tm6">He, through individual and collective consciousness has understood the importance of happiness and prosperity in life and consequently, he tries to establish a humanly relationship between\r\nmany existing objects/orders. And, this is only possible if he lives in harmony at all the four levels i.e. Self, Family, Society and Nature. He also needs to under that existence is all about living in co-existence. </span></div><div style="text-align: justify;"><span class="tm6"><br></span></div>\r\n<div style="text-align: justify;"><span class="tm6">Apart from the scientific and technological advancements, we need to understand the importance of value education which stands for morality, ethics, values and above all humanism, and\r\ninculcates a deep concern for well being of others and the nation while being selfless. It is a journey from human being to being human, and teaches us how we respond to others (Self, Family, Society, World and Nature) for\r\nachieving a holistic view and development at large. Thus, Value Education aims in intellectual development of human beings and enables them to live in co-existence with various entities, and trains how to cope up with the\r\nchallenging situations within available resources. Apart from this, it also equips students with life skills and humanly touch. </span></div><div style="text-align: justify;"><span class="tm6"><br></span></div>\r\n<div style="text-align: justify;"><span class="tm6">Value cell will help students to understand the concept of human values which lead them to live in harmony at all four levels .it also provide a platform to solve their problems.</span></div>\r\n<div style="text-align: justify;">&nbsp;</div>', '12'),
(8, '<div><b><span style="font-size:22.5pt;font-family:&quot;Lucida Sans Unicode&quot;,&quot;sans-serif&quot;;\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#313338;mso-fareast-language:\nEN-IN">About Us<o:p></o:p></span></b></div>\n\n<div><span style="font-size: 10.5pt; font-family: &quot;Lucida Sans Unicode&quot;, sans-serif;">We always welcome students to join us with aim for overall development\nof individual as well Department. The department strives for continuous\nimprovement in quality of education through curriculum development and up\ngradation of laboratories. The department can boast of very well equipped Heat\nEngines &amp; Strength of Materials, Refrigeration and Air Conditioning,\nHydraulics &amp; Theory of Machines and Production Laboratories. The department\nalso has a well-equipped workshop that caters to the need of the entire\ncollege.<o:p></o:p></span></div>\n\n<div><b><span style="font-size:22.5pt;font-family:&quot;Lucida Sans Unicode&quot;,&quot;sans-serif&quot;;\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#313338;mso-fareast-language:\nEN-IN">Vision<o:p></o:p></span></b></div>\n\n<div><i><span style="font-size: 10.5pt; font-family: &quot;Lucida Sans Unicode&quot;, sans-serif;">To contribute towards building technically competent, socially aware and\nprofessionally ethical Mechanical Engineers</span></i><span style="font-size: 10.5pt; font-family: &quot;Lucida Sans Unicode&quot;, sans-serif;"><o:p></o:p></span></div>\n\n<div><b><span style="font-size:22.5pt;font-family:&quot;Lucida Sans Unicode&quot;,&quot;sans-serif&quot;;\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#313338;mso-fareast-language:\nEN-IN">Missions<o:p></o:p></span></b></div>\n\n<div><span style="font-size:12.0pt;font-family:Symbol;mso-ascii-font-family:\n&quot;Times New Roman&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\n&quot;Times New Roman&quot;;mso-fareast-language:EN-IN">·</span><span style="font-size:\n12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\nmso-fareast-language:EN-IN">&nbsp; To develop\ncore competency by imparting sound theoretical, analytical and practical\nknowledge.<o:p></o:p></span></div>\n\n<div><span style="font-size:12.0pt;font-family:Symbol;mso-ascii-font-family:\n&quot;Times New Roman&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\n&quot;Times New Roman&quot;;mso-fareast-language:EN-IN">·</span><span style="font-size:\n12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\nmso-fareast-language:EN-IN">&nbsp; To enhance\nemployability skills and develop entrepreneurship aptitude of the students.<o:p></o:p></span></div>\n\n<div><span style="font-size:12.0pt;font-family:Symbol;mso-ascii-font-family:\n&quot;Times New Roman&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\n&quot;Times New Roman&quot;;mso-fareast-language:EN-IN">·</span><span style="font-size:\n12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\nmso-fareast-language:EN-IN">&nbsp; To educate\nand develop human resources for industry, academia, Teaching and development.<o:p></o:p></span></div>\n\n<div><b><span style="font-size:22.5pt;font-family:&quot;Lucida Sans Unicode&quot;,&quot;sans-serif&quot;;\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#313338;mso-fareast-language:\nEN-IN">Program Specific Outcomes<o:p></o:p></span></b></div>\n\n<div><span style="font-size:12.0pt;font-family:Symbol;mso-ascii-font-family:\n&quot;Times New Roman&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\n&quot;Times New Roman&quot;;mso-fareast-language:EN-IN">·</span><span style="font-size:\n12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\nmso-fareast-language:EN-IN">&nbsp; Students\nshall be capable of applying fundamental knowledge in solving problems in the\ndomain of mechanical engineering.<o:p></o:p></span></div>\n\n<div><span style="font-size:12.0pt;font-family:Symbol;mso-ascii-font-family:\n&quot;Times New Roman&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\n&quot;Times New Roman&quot;;mso-fareast-language:EN-IN">·</span><span style="font-size:\n12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\nmso-fareast-language:EN-IN">&nbsp; Ability to\ndesign mechanical components, develop their production process and evaluate\nperformance on quality, environment and economic measures.<o:p></o:p></span></div>\n\n<div><span style="font-size:12.0pt;line-height:115%;font-family:\nSymbol;mso-ascii-font-family:&quot;Times New Roman&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-fareast-language:EN-IN">·</span><span style="font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:EN-IN">&nbsp; Students shall be capable of applying analytical,\npractical and soft skills in solving problems in the domain of mechanical\nengineering.<o:p></o:p></span></div>\n\n<div><b><span style="font-size:22.5pt;line-height:115%;\nfont-family:&quot;Lucida Sans Unicode&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\ncolor:#313338;mso-fareast-language:EN-IN">Programs<o:p></o:p></span></b></div>\n\n<div><!--[if !supportLists]--><span style="font-size:18.0pt;mso-bidi-font-size:22.5pt;line-height:115%;font-family:\nSymbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#313338;\nmso-fareast-language:EN-IN;mso-bidi-font-weight:bold">·<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n</span></span><!--[endif]--><b><span style="font-size:18.0pt;mso-bidi-font-size:\n22.5pt;line-height:115%;font-family:&quot;Lucida Sans Unicode&quot;,&quot;sans-serif&quot;;\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#313338;mso-fareast-language:\nEN-IN">Bachelor of Technology <o:p></o:p></span></b></div>\n\n<div><!--[if !supportLists]--><span style="font-size:18.0pt;mso-bidi-font-size:22.5pt;line-height:115%;font-family:\nSymbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#313338;\nmso-fareast-language:EN-IN;mso-bidi-font-weight:bold">·<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n</span></span><!--[endif]--><b><span style="font-size:18.0pt;mso-bidi-font-size:\n22.5pt;line-height:115%;font-family:&quot;Lucida Sans Unicode&quot;,&quot;sans-serif&quot;;\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#313338;mso-fareast-language:\nEN-IN">Master of Technology </span><span style="font-size: 18pt; line-height: 115%; color: rgb(49, 51, 56);"><font face="Courier New">in</font></span></b><span style="font-size: 18pt; line-height: 115%; font-family: &quot;Courier New&quot;; color: rgb(49, 51, 56);"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;&nbsp;</span></span><b><span style="font-size:18.0pt;mso-bidi-font-size:22.5pt;line-height:115%;font-family:\n&quot;Lucida Sans Unicode&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\ncolor:#313338;mso-fareast-language:EN-IN">&nbsp;</span></b><b><span style="font-size:16.0pt;\nmso-bidi-font-size:22.5pt;line-height:115%;font-family:&quot;Lucida Sans Unicode&quot;,&quot;sans-serif&quot;;\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#313338;mso-fareast-language:\nEN-IN">Production Engineering</span></b></div>\n\n<div><!--[if !supportLists]--><span style="font-size:9.0pt;mso-bidi-font-size:12.0pt;line-height:115%;font-family:\nSymbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;mso-fareast-language:\nEN-IN">·<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n</span></span><!--[endif]--><b><span style="font-size:18.0pt;mso-bidi-font-size:\n22.5pt;line-height:115%;font-family:&quot;Lucida Sans Unicode&quot;,&quot;sans-serif&quot;;\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#313338;mso-fareast-language:\nEN-IN">Doctor in Philosophy<br></span></b><span style="font-size:9.0pt;mso-bidi-font-size:\n12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:\n&quot;Times New Roman&quot;;mso-fareast-language:EN-IN"><o:p></o:p></span></div>', '');
INSERT INTO `aboutus` (`id`, `aboutus`, `department`) VALUES
(9, '<div><font color="#0000ff"><span style="font-size: 30px;"><b></b></span></font></div><div><div><span style="font-size: 30px;"><span style="font-weight: 700;"><font color="#0000ff">About us</font></span></span></div><div><span style="font-size: 10.5pt;">We always welcome students to join us with aim for overall development of individual as well Department. The department strives for continuous improvement in quality of education through curriculum development and up gradation of laboratories. The department can boast of very well equipped Heat Engines &amp; Strength of Materials, Refrigeration and Air Conditioning, Hydraulics &amp; Theory of Machines and Production Laboratories. The department also has a well-equipped workshop that caters to the need of the entire college.</span></div><div><span style="font-weight: 700;"><span style="font-size: 22.5pt;"><font color="#0000ff">Vision</font></span></span></div><div><i><span style="font-size: 10.5pt;">To contribute towards building technically competent, socially aware and professionally ethical Mechanical Engineers</span></i><span style="font-size: 10.5pt;"></span></div><div><span style="font-weight: 700;"><span style="font-size: 22.5pt;"><font color="#0000ff">Missions</font></span></span></div><div><span style="font-size: 12pt; font-family: Symbol;">·</span><span style="font-size: 12pt;">&nbsp; To develop core competency by imparting sound theoretical, analytical and practical knowledge.</span></div><div><span style="font-size: 12pt; font-family: Symbol;">·</span><span style="font-size: 12pt;">&nbsp; To enhance employability skills and develop entrepreneurship aptitude of the students.</span></div><div><span style="font-size: 12pt; font-family: Symbol;">·</span><span style="font-size: 12pt;">&nbsp; To educate and develop human resources for industry, academia, Teaching and development.</span></div><div><font color="#0000ff"><span style="font-size: 12pt;"><span style="font-weight: 700;"><span style="font-size: 22.5pt;">Program&nbsp;</span></span></span><span style="font-size: 30px;"><span style="font-weight: 700;">Education Objectives</span></span></font></div><div><div><span style="font-size: 12pt; font-family: Symbol;">·</span><span style="font-size: 12pt;">&nbsp;&nbsp;</span>To impart conceptual and fundamental knowledge of design, thermal, production, industrial and other interdisciplinary streams</div><div><span style="font-size: 12pt; font-family: Symbol;">·</span><span style="font-size: 12pt;">&nbsp;&nbsp;</span>To enable students to apply fundamentals of mechanical engineering in solving&nbsp;practical problems by working in a team<span style="font-size: 12pt;">.</span></div><div><span style="font-size: 12pt; font-family: Symbol;">·</span><span style="font-size: 12pt;">&nbsp;&nbsp;</span>Students shall be groomed for employability and entrepreneurship by involving&nbsp;experts from academia and industry<span style="font-size: 12pt;">.</span></div></div><div><span style="font-size: 12pt; font-family: Symbol;">·</span><span style="font-size: 12pt;">&nbsp;&nbsp;</span>Students shall be capable of solving industrial and experimental problems using&nbsp;software and other associated skills<span style="font-size: 12pt;">.</span></div><div><span style="font-weight: 700;"><span style="font-size: 22.5pt;"><font color="#0000ff">Program Specific Outcomes</font></span></span></div><div><span style="font-size: 12pt; font-family: Symbol;">·</span><span style="font-size: 12pt;">&nbsp; Students shall be capable of applying fundamental knowledge in solving problems in the domain of mechanical engineering.</span></div><div><span style="font-size: 12pt; font-family: Symbol;">·</span><span style="font-size: 12pt;">&nbsp; Ability to design mechanical components, develop their production process and evaluate performance on quality, environment and economic measures.</span></div><div><span style="font-size: 12pt; line-height: 17.12px; font-family: Symbol;">·</span><span style="font-size: 12pt; line-height: 17.12px;">&nbsp; Students shall be capable of applying analytical, practical and soft skills in solving problems in the domain of mechanical engineering.</span></div><div><span style="font-weight: 700;"><span style="font-size: 22.5pt; line-height: 32.1px;"><font color="#0000ff">Program</font></span></span></div><div><span style="font-size: 16pt; line-height: 22.8267px; font-family: Symbol;"><font color="#313338">·</font><span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;"><font color="#313338">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</font><font color="#31859b">&nbsp;</font></span></span><span style="font-weight: 700;"><span style="font-size: 16pt; line-height: 22.8267px;"><font color="#31859b">Bachelor in Technology</font></span></span></div><div>&nbsp; &nbsp;o<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;">&nbsp; &nbsp;&nbsp;</span>Mechanical&nbsp;<span style="font-size: 12pt; line-height: 17.12px;">Engineering</span></div><div><span style="font-size: 16pt; line-height: 22.8267px; font-family: Symbol; color: rgb(49, 51, 56);">·<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style="font-weight: 700;"><span style="font-size: 16pt; line-height: 22.8267px;"><font color="#31859b">Master in Technology</font></span></span></div><div>&nbsp; &nbsp;o<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;">&nbsp;&nbsp;&nbsp;</span>Production Engineering</div><div>&nbsp; &nbsp;o<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;">&nbsp; &nbsp;</span>Renewable Energy</div><div><span style="font-size: 16pt; line-height: 22.8267px; font-family: Symbol; color: rgb(49, 51, 56);">·<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style="font-weight: 700;"><span style="font-size: 16pt; line-height: 22.8267px;"><font color="#31859b">Doctor in Philosophy</font></span></span></div></div><div><font color="#0000ff"><span style="font-size: 30px;"><b></b></span></font></div>', 'D'),
(10, '<div><h1>About Physics Dept.</h1> test about us</div>', 'phy'),
(11, '<h1>Chemistry</h1><div><br></div><div><div><a name="_Hlk98851728"><span style="font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(51, 51, 51); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">Welcome to\r\nthe Department of Chemistry !<o:p></o:p></span></a></div>\r\n\r\n<div><span style="font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">Chemistry, one of the basic sciences is the key to\r\nEngineering education and is one of the most important subject for engineering\r\nstudents. It serves as the foundation on which the students future is to be\r\nbuilt. The Department of Chemistry with its highly qualified and dedicated\r\nfaculty members moves forward with the vision of <b>Strengthening Fundamentals For\r\na Strong Future.</b> The educational objective of the Department is to provide\r\noutstanding education that promotes a philosophy of learning that develops an\r\ninnovative mindset enabling the student&nbsp;\r\nto provide technological solutions to the problems in neighbourhood and\r\nsociety.</span><span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;color:black;\r\nmso-color-alt:windowtext"> </span><span style="font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">Our Mission is to prepare students for productive careers by\r\nproviding an excellent environment for teaching and learning. We aim to empower\r\nour students to meet the challenges of academic and industrial arenas.<o:p></o:p></span></div>\r\n\r\n<div><span style="font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">The department has well equipped laboratories with all\r\nfacilities which cater to the latest syllabus of the affiliating university. The\r\nfaculty members are the strength of the department who with their knowledge and\r\nexperience serve as to enlighten the path of the students towards a bright\r\nfuture.</span><span style="font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#282828"><o:p></o:p></span></div></div>', 'chem'),
(12, '<div><span style="font-family: " source="" sans="" pro",="" "lucida="" unicode",="" grande",="" sans-serif;="" font-size:="" 14px;="" text-align:="" justify;="" background-color:="" rgb(246,="" 246,="" 246);"="">Welcome to Department of Mathematics. The faculty members of the Department is teaching mathematics to about 1500 undergraduate and post graduate students. The members of the Department have published more than 150 research papers in national and international journals/conferences of repute. Apart from this, the Department has organized international and national level conferences. The faculty members of the Department have also organized Short Term courses. The faculty members of the Department hold key positions / posts and memberships of various national academic bodies and societies. Our Mission is to prepare post-graduate students for productive careers in academic by providing an excellent environment for teaching, learning, and research in the theory and applications of Mathematics, we aim to produce highly qualified and well-rounded possessing fundamental knowledge of mathematics and to pursue creative research in order to serve the needs of academic and the scientific community by expanding and contributing the knowledge in the field. Our Vision is to be a recognized leader in Mathematics research and to have a strong impact in our targeted areas of research. Educational Objectives of the Department are to provide outstanding education and research programs that promote a philosophy of learning that develops a diverse Mathematics student that can be prepared for their specific profession, for advanced studies and careers in research.</span></div>', 'math'),
(13, '<div>The Department of Computer Science and Engineering at Engineering \r\nCollege Ajmer is known for imparting state of the art education and \r\npreparing its students for real world challenges. The initial \r\n"computer-related" courses were started in August 2000 with the intake \r\nof 30 students in Computer Engineering and 30 in Information Technology.\r\n Currently the department is having an intake of 120 students in Computer\r\n Engineering, 60 in Information Technology and 60 in Computer Science and Engineering(Cyber Security) at B. Tech level. We \r\nattract the brightest students from the state who score very high ranks \r\nin the engineering entrance examinations, for the PG course, department \r\nhas an intake of 9 students in Computer Engineering, Information Technology and Software Engineering. At \r\npresent, the department is having a 17 regular faculty, whose interests span in almost all areas of Computer Science. \r\nComputer Science and Engineering department is having 9 Computer Labs \r\nand a Central Computer Center with latest computer configuration. Each \r\nlab is having capacity of 30 computers and Center is having capacity of \r\n100 computers. All the computers are connected in local area network \r\n(wired and wireless) with Internet Connection of 1Gbps leased line link \r\nand 100 Mbps 1:1 bandwidth. Highly configured servers have been \r\ninstalled. Department is also having the latest CISCO routers and \r\nswitches for networking.</div>', 'A'),
(14, '<div style="text-align: justify;"><b><span lang="EN-US" style="font-size:14.0pt;\r\nline-height:150%;font-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;="" mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:minor-latin;color:black"="">ABOUT\r\nUS</span></b><span lang="EN-US" style="font-size:14.0pt;line-height:150%;\r\nfont-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:="" minor-latin;mso-bidi-theme-font:minor-latin"=""><o:p></o:p></span></div>\r\n\r\n<div><span lang="EN-US" style="font-size:12.0pt;line-height:150%;\r\nfont-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:="" minor-latin;mso-bidi-theme-font:minor-latin;color:black;mso-color-alt:windowtext"="">The\r\nDepartment of Management Studies is initiated with the objective of providing holistic\r\nmanagerial knowledge and exposure to the students through experienced faculty\r\nmembers, excellent infrastructure and advanced technology that helps them grow\r\nas socially responsible business leaders. </span><span lang="EN-US" style="font-size:12.0pt;line-height:150%;font-family:" calibri",sans-serif;="" mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:="" minor-latin"=""><o:p></o:p></span></div>\r\n\r\n<div><span lang="EN-US" style="font-size:12.0pt;line-height:150%;\r\nfont-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:="" minor-latin;mso-bidi-theme-font:minor-latin;color:black;mso-color-alt:windowtext"="">The\r\nDepartment has qualified and specialized team of faculty members in various\r\nstreams of management to impart quality education. </span><span lang="EN-US" style="font-size:12.0pt;line-height:150%;font-family:" calibri",sans-serif;="" mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:="" minor-latin"=""><o:p></o:p></span></div>\r\n\r\n<div><span lang="EN-US" style="font-size:12.0pt;line-height:150%;\r\nfont-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:="" minor-latin;mso-bidi-theme-font:minor-latin;color:black;mso-color-alt:windowtext"="">The\r\ndepartment is also approved Research Centre of Bikaner Technical University,\r\nBikaner for Doctoral programme. Presently, 11 Research scholars are pursuing\r\ndoctoral degree program.</span><span lang="EN-US" style="font-size:12.0pt;\r\nline-height:150%;font-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;="" mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:minor-latin"=""><o:p></o:p></span></div>\r\n\r\n<div><b><span lang="EN-US" style="font-size:12.0pt;line-height:150%;\r\nfont-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:="" minor-latin;mso-bidi-theme-font:minor-latin"="">&nbsp;</span></b></div>\r\n\r\n<div><b><span lang="EN-US" style="font-size:12.0pt;line-height:150%;\r\nfont-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:="" minor-latin;mso-bidi-theme-font:minor-latin"="">VISION<o:p></o:p></span></b></div>\r\n\r\n<div><span lang="EN-US" style="font-size:12.0pt;line-height:150%;font-family:" calibri",sans-serif;="" mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:="" minor-latin"="">To create a Centre of excellence for developing socially\r\nresponsible business leaders.<o:p></o:p></span></div>\r\n\r\n<div><span lang="EN-US" style="font-size:12.0pt;line-height:150%;font-family:\r\n" calibri",sans-serif;mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:="" minor-latin;mso-bidi-theme-font:minor-latin"="">&nbsp;</span></div>\r\n\r\n<div><b><span lang="EN-US" style="font-size:12.0pt;line-height:150%;\r\nfont-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:="" minor-latin;mso-bidi-theme-font:minor-latin"="">MISSION<o:p></o:p></span></b></div>\r\n\r\n<div><span lang="EN-US" style="font-size:12.0pt;line-height:\r\n150%;font-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;="" mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:minor-latin"="">M1: &nbsp;&nbsp;&nbsp; To develop the expertise in different\r\nfunctional areas of management for business and industrial challenges.<o:p></o:p></span></div>\r\n\r\n<div><span lang="EN-US" style="font-size:12.0pt;line-height:\r\n150%;font-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;="" mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:minor-latin"="">M2: &nbsp;&nbsp;&nbsp; To extend frontiers of management through\r\nrelevant and contextual business research.<o:p></o:p></span></div>\r\n\r\n<div><span lang="EN-US" style="font-size:12.0pt;line-height:\r\n150%;font-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;="" mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:minor-latin"="">M3:&nbsp;&nbsp;&nbsp;&nbsp; To bring up ethical business leaders\r\nresponsible to society and environment.<o:p></o:p></span></div>\r\n\r\n<div><b><span lang="EN-US" style="font-size:12.0pt;line-height:150%;\r\nfont-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:="" minor-latin;mso-bidi-theme-font:minor-latin;color:black;letter-spacing:-.1pt"="">&nbsp;</span></b></div>\r\n\r\n<div><b><span lang="EN-US" style="font-size:12.0pt;line-height:150%;font-family:" calibri",sans-serif;="" mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:="" minor-latin"="">PROGRAMMES<o:p></o:p></span></b></div>\r\n\r\n<div><!--[if !supportLists]--><span lang="EN-US" style="font-size:12.0pt;line-height:150%;font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;mso-bidi-font-weight:\r\nbold">·<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: " times="" new="" roman";"="">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><b><span lang="EN-US" style="font-size:12.0pt;\r\nline-height:150%;font-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;="" mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:minor-latin"="">Ph.D. in\r\nManagement <o:p></o:p></span></b></div>\r\n\r\n<div><!--[if !supportLists]--><span lang="EN-US" style="font-size:12.0pt;line-height:150%;font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;mso-bidi-font-weight:\r\nbold">·<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: " times="" new="" roman";"="">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><b><span lang="EN-US" style="font-size:12.0pt;\r\nline-height:150%;font-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;="" mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:minor-latin"="">MBA (Dual\r\nSpecialization)<o:p></o:p></span></b></div>\r\n\r\n<div><b><span lang="EN-US" style="font-size:12.0pt;\r\nline-height:150%;font-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;="" mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:minor-latin"="">&nbsp;</span></b></div><div><b><span lang="EN-US" style="font-size:12.0pt;\r\nline-height:150%;font-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;="" mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:minor-latin;color:black;="" mso-color-alt:windowtext"="">Ph.D. in Management</span></b></div>\r\n\r\n<div><span lang="EN-US" style="font-size:12.0pt;line-height:150%;font-family:" calibri",sans-serif;="" mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:="" minor-latin;color:black;mso-color-alt:windowtext"="">The department offers\r\nfulltime/part-time Ph.D. programs in various functional areas of Management.</span><span lang="EN-US" style="font-size: 12pt; line-height: 150%; font-family: Calibri, sans-serif;">&nbsp;</span><span lang="EN-US" style="font-size: 12pt; line-height: 150%; font-family: Calibri, sans-serif; color: black;">Admissions are offered through<b>&nbsp;</b></span><span lang="EN-US" style="font-size: 12pt; line-height: 150%; font-family: Calibri, sans-serif; color: black;">BTU Doctoral Admission Test conducted by Bikaner Technical University, Bikaner every year.</span></div>\r\n\r\n<div><b><span lang="EN-US" style="font-size:12.0pt;\r\nline-height:150%;font-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;="" mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:minor-latin"="">&nbsp;</span></b></div>\r\n\r\n<div><b><span lang="EN-US" style="font-size:12.0pt;\r\nline-height:150%;font-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;="" mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:minor-latin;color:black;="" mso-color-alt:windowtext"="">Masters in Business Administration (MBA)</span></b><span lang="EN-US" style="font-size:12.0pt;line-height:150%;font-family:" calibri",sans-serif;="" mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:="" minor-latin;color:black"=""><o:p></o:p></span></div>\r\n\r\n<div><span lang="EN-US" style="font-size:12.0pt;line-height:150%;\r\nfont-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:="" minor-latin;mso-bidi-theme-font:minor-latin;color:black"="">The Masters in\r\nBusiness Administration (MBA) is a two-year AICTE approved Full-Time programme.\r\nThe programme offers dual specialization in the following areas:</span><span lang="EN-US" style="font-size:12.0pt;line-height:150%;font-family:" calibri",sans-serif;="" mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:="" minor-latin"=""><o:p></o:p></span></div>\r\n\r\n<div><!--[if !supportLists]--><span lang="EN-US" style="font-size:12.0pt;line-height:150%;font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol">·<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: " times="" new="" roman";"="">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang="EN-US" style="font-size:12.0pt;\r\nline-height:150%;font-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;="" mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:minor-latin;color:black;="" mso-color-alt:windowtext"="">Finance</span><span lang="EN-US" style="font-size:12.0pt;\r\nline-height:150%;font-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;="" mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:minor-latin"=""><o:p></o:p></span></div>\r\n\r\n<div><!--[if !supportLists]--><span lang="EN-US" style="font-size:12.0pt;line-height:150%;font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol">·<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: " times="" new="" roman";"="">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang="EN-US" style="font-size:12.0pt;\r\nline-height:150%;font-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;="" mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:minor-latin;color:black;="" mso-color-alt:windowtext"="">Human Resource Management</span><span lang="EN-US" style="font-size:12.0pt;line-height:150%;font-family:" calibri",sans-serif;="" mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:="" minor-latin"=""><o:p></o:p></span></div>\r\n\r\n<div><!--[if !supportLists]--><span lang="EN-US" style="font-size:12.0pt;line-height:150%;font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol">·<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: