n</span></span><!--[endif]--><span lang="EN-US" style="font-size:12.0pt;\r\nline-height:150%;font-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;="" mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:minor-latin;color:black;="" mso-color-alt:windowtext"="">Business Analytics</span><span lang="EN-US" style="font-size:12.0pt;line-height:150%;font-family:" calibri",sans-serif;="" mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:="" minor-latin"=""><o:p></o:p></span></div>\r\n\r\n<div><!--[if !supportLists]--><span lang="EN-US" style="font-size:12.0pt;line-height:150%;font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol">·<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: " times="" new="" roman";"="">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang="EN-US" style="font-size:12.0pt;\r\nline-height:150%;font-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;="" mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:minor-latin;color:black;="" mso-color-alt:windowtext"="">Agri Business Management</span><span lang="EN-US" style="font-size:12.0pt;line-height:150%;font-family:" calibri",sans-serif;="" mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:="" minor-latin"=""><o:p></o:p></span></div>\r\n\r\n<div><span lang="EN-US" style="font-size:12.0pt;line-height:150%;\r\nfont-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:="" minor-latin;mso-bidi-theme-font:minor-latin"="">&nbsp;</span></div>\r\n\r\n<div><b><span lang="EN-US" style="font-size:12.0pt;line-height:150%;\r\nfont-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:="" minor-latin;mso-bidi-theme-font:minor-latin"="">PROGRAMME EDUCATIONAL OUTCOMES<o:p></o:p></span></b></div>\r\n\r\n<div><span lang="EN-US" style="font-size:12.0pt;line-height:\r\n150%;font-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;="" mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:minor-latin"="">PEO1:&nbsp; Able to communicate effectively to apply\r\nmanagement principles in real world.<o:p></o:p></span></div>\r\n\r\n<div><span lang="EN-US" style="font-size:12.0pt;line-height:\r\n150%;font-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;="" mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:minor-latin"="">PEO2:&nbsp; Proficient in decision making and solving\r\ncomplex managerial problems.<o:p></o:p></span></div>\r\n\r\n<div><span lang="EN-US" style="font-size:12.0pt;line-height:\r\n150%;font-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;="" mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:minor-latin"="">PEO3:&nbsp; Capable of conducting theoretical as well as\r\napplied research independently<o:p></o:p></span></div>\r\n\r\n<div><span lang="EN-US" style="font-size:12.0pt;line-height:\r\n150%;font-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;="" mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:minor-latin"="">PEO4:&nbsp; Determined about professional and ethical\r\nresponsibility<o:p></o:p></span></div>\r\n\r\n<div><span lang="EN-US" style="font-size:12.0pt;line-height:150%;font-family:\r\n" calibri",sans-serif;mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:="" minor-latin;mso-bidi-theme-font:minor-latin"="">&nbsp;</span></div>\r\n\r\n<div><b><span lang="EN-US" style="font-size:12.0pt;line-height:150%;\r\nfont-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:="" minor-latin;mso-bidi-theme-font:minor-latin"="">PROGRAMME SPECIFIC OUTCOMES<o:p></o:p></span></b></div>\r\n\r\n<div><span lang="EN-US" style="font-size:12.0pt;line-height:\r\n150%;font-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;="" mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:minor-latin"="">PSO1:&nbsp; Graduates will be able to apply their\r\nmanagerial skills, exhibit critical thinking and problem-solving aptitude in\r\nprofessional manner to meet business and relevant social challenges. <o:p></o:p></span></div>\r\n\r\n<div><span lang="EN-US" style="font-size:12.0pt;line-height:\r\n150%;font-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;="" mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:minor-latin"="">PSO2:&nbsp; Graduates will be ethical in exhibiting\r\neffective skills of communication, management and leadership.<o:p></o:p></span></div>\r\n\r\n<div><span lang="EN-US" style="font-size:12.0pt;line-height:\r\n150%;font-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;="" mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:minor-latin"="">PSO3:&nbsp; Graduates will possess proficiency in their\r\nareas of specialisation in management to prove their competencies. <o:p></o:p></span></div>\r\n\r\n<div><span lang="EN-US" style="font-size:12.0pt;line-height:\r\n150%;font-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;="" mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:minor-latin"="">PSO4:&nbsp; Graduates will be able to demonstrate their\r\nresearch skills for creativity and innovation.<o:p></o:p></span></div>\r\n\r\n<div><span lang="EN-US" style="font-size:12.0pt;line-height:150%;font-family:" calibri",sans-serif;="" mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:="" minor-latin"="">&nbsp;</span></div>\r\n\r\n<div><b><span lang="EN-US" style="font-family:" calibri",sans-serif;="" mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:="" minor-latin;mso-bidi-language:hi"="">Course Duration:</span></b><span lang="EN-US" style="font-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;="" mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:minor-latin;mso-bidi-language:="" hi"="">&nbsp; &nbsp; &nbsp; &nbsp;Two Years<o:p></o:p></span></div>\r\n\r\n<div><b><span lang="EN-US" style="font-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;="" mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:minor-latin;mso-bidi-language:="" hi"="">Total Seats:</span></b><span lang="EN-US" style="font-family:" calibri",sans-serif;="" mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:="" minor-latin;mso-bidi-language:hi"=""> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 60<o:p></o:p></span></div>\r\n\r\n<div><b><span lang="EN-US" style="font-size:12.0pt;\r\nline-height:150%;font-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;="" mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:minor-latin"="">Eligibility\r\nof Admission: </span></b><span lang="EN-US" style="font-size:12.0pt;line-height:\r\n150%;font-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;="" mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:minor-latin"="">Admission to\r\nthe Master of Business Administration Programme shall be open to all the\r\ncandidates who have passed qualifying Examinations (Graduation from any stream)\r\nof any recognized University / Institution or any other examinations recognized\r\nas equivalent thereto by competent authority with not less than 50% (45% in\r\ncase of SC/ST/Divyanga/ visually impaired) of the marks of the degree\r\nexaminations.<o:p></o:p></span></div>\r\n\r\n<div><b><span lang="EN-US" style="font-size:12.0pt;\r\nline-height:150%;font-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;="" mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:minor-latin"="">Admission\r\nProcess:</span></b><span lang="EN-US" style="font-size:12.0pt;line-height:150%;\r\nfont-family:" calibri",sans-serif;mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:="" minor-latin;mso-bidi-theme-font:minor-latin"=""> Through the Nodal Agency as\r\ndecided by Technical Education Department, Govt. of Rajasthan<br></span><span lang="EN-US" style="font-size:12.0pt;line-height:150%;font-family:" calibri",sans-serif;="" mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:="" minor-latin;color:black;mso-bidi-language:hi"=""><o:p></o:p></span></div>', 'G');
