INSERT INTO `achievements` (`id`, `achievement`, `department`) VALUES
(1, 'Mr. Vinod Kumar Verma Awarded by MHRD Minister (State) Dr. Satya Pal Singh at AICTE, for acheiving 2nd Prize at 1st Vishwakarma Award at New Delhi', 'D'),
(2, 'Dr. Devendra Choudhary Won Highly Cited Research Award in JPSM by Elsevier, 2016', 'D'),
(4, 'With the coordination of Govt. Engineering College Ajmer to Ajmer Police, an android app named “Ajmer Police” is developed. The app can be downloaded from play store. The main objective of the app is to make contribution of citizens in avoiding non compliance of traffic rules. A citizen can use the app and upload the pics of various non compliances like without helmet driving, overloading, red light crossing etc. Second feature of app is to fulfil blood required with ease. The needy can post the requirement through the app and donor may donate blood. The third module is for providing help to senior citizen in case of any fear/emergency. The app is developed by a team of students Rohit Kamra, Laxman Mali, Mukesh Bhati in guidance with 3 faculty members Dr. Rakesh Rathi, Sh. Vinesh Jain & Smt. Jyoti Gajrani. \r\n', 'A'),
(5, ' Sh. Prakash Meena is senior member IEEE and Joint Secretary IEEE Rajasthan Subsection. He is advisor and mentor IEEE student Branch, Ajmer.', 'A'),
(6, 'Mrs. Jyoti Gajrani visited University of Bordeaux, France for R&D Work.', 'A'),
(7, ' Sh. Atul Choudhary, Sh. H.R. Choudhary, Sh. Dinesh Kr. Khunteta, Sh. V. P. Sharma and Sh. Vinesh Jain have book published for RBSE Board Xth and XIIth for Computer Fundamentals and Programming.', 'A'),
(8, 'Sh. Vinesh Jain is member of Board of Studies (CS & IT) at RTU Kota.', 'A'),
(9, 'Sh. H. R. Choudhary is member of Board of Studies (CS & IT) at RBSE, Ajmer.\r\n', 'A'),
(10, 'Expert Lecture on SMART GRID TECHNOLOGIES on 02-03-2019 by Dr. Annapurna Bhargava', 'F'),
(11, 'Three Students of final year (Hemraj Saini, Anshul Yadav and Ramesh Kumawat) have been selected in Uttam Galva.', 'F'),
(12, 'One student (Ayushi Awasthi 6th Sem) got 4th position in Smart India Hackathon-2019', 'F'),
(13, 'Expert Lecture on INDIAN PATENT SYSTEM on 07-04-2018 by Dr. D. K. Palwalia', 'F'),
(14, 'Expert Lecture on "TWO PORT NETWORKS AND NETWORK SYNTHESIS" on 06-04-2018 by Dr. D. K. Palwalia', 'F'),
(15, 'Expert Lecture on "POWER SYSTEM PROTECTION OF GLOBAL INTEREST" on 21-03-2018 by Prof. Dinesh Birla', 'F'),
(16, 'Total 13 students of Electrical Engineering Department Qualified in GATE Qualification in 2018-19.', 'F'),
(19, 'First time in the history of GECA, two students of Final year Mechanical Engineering Prateek Verma and Sanjay Rathore has co-authored the paper titled "Performance Investigation of Triangular Solar Air Heater Duct having Broken Inclined Roughness using Computational Fluid Dynamics" in esteemed journal, ASME. ', 'D'),
