(38, 'Ongoing Projects:- \r\nAn efficient solar PV based\r\nhybrid multioutput\r\nconverter for standalone\r\napplication, by  Mr. Raj Kumar\r\nYadav, Dr. C.P.Jain, Rs. 13.72 Lakhs', 'E'),
