(41, 'Ongoing Projects:-Band gap optimization of\r\nCNT thin film for nano\r\noptical antenna and other\r\noptoelectronic devices.by Mr. Atul Kumar\r\nSharma,\r\nDr. H.S.Mewara,  Dr. Anup Kumar\r\nSharma, Rs 8.12 Lakhs', 'E'),
