(45, 'Akshay Tunwal 12EEAEI001	76.60      Rank /Merit 8', 'E'),
(46, 'Organised a National Workshop on "Research Projects, Funding and Opportunities in Engineering and Sciences" from May 29-30, 2019', 'D'),
(47, 'Organised one week STC on "Renewable Energy Systems and Their Techno-Economic Feasibility in India" from July 8-12, 2019', 'D'),
(48, 'FDP/STC/Workshop Organised by Dept.: - \r\n1) One week STC on ''Emerging Trends on smart and sustainable Infrastructures'' \r\n2). One week Workshop on computational techniques and their applications in Civil Engineering.(11-15 Sept. 2018) \r\n3). National Workshop on Earthquake Dynamics and design of RC buildings. (25-26 Feb. 2017)\r\n4). One day Workshop on Ethics in technical education and personality development.(23 Jan. 2017) \r\n5). Seminar on Human values in Education. (29-30 March 2017)', 'C'),
(49, 'Consultancy: - Department of Civil Engineering has started consultancy works related to Design, Construction, Quality Investigation of structures like Road Pavements, Buildings, Bridges etc.. Department has also developed following well equipped testing labs in the subsequent years, which are also being utilized for consultancy work. 1). Concrete and Material testing Lab. 2). Geotechnical Engineering Lab 3). Road Material Testing Lab 4). Surveying lab 5). Environmental Engineering Lab', 'C'),
(50, 'Technical Seminar on "Physical and Chemical properties of cement and Mix design of concrete" by J.K. Super Cement on 28 Jan. 2019', 'C'),
(51, 'Mr. Satya narayan Tazi has been awarded certificate of appreciation by Chairman NPTEL for active SPOC based on performance and participation of candidates from Govt. Engineering College Ajmer', 'A'),
(52, 'Mr. Vinesh Jain has given certificate of appreciation by INTERNSHALA for helping Govt. Engineering College Ajmer securing an all India rank of 268 out of 2830 college participating in 2019.', 'A'),
(53, 'Mr. Satya narayan Tazi is given NVIDIA GPU Grant of Titan Xp for supporting his research.', 'A'),
(54, 'Book Titled "Computer Technology and Programming-II"  for 12th class (RBSE) written by H. R. Choudhary , V. P. Sharma and Anil Kumar Tailor in 2018-19 is published by Rajasthan State textbook board, Jaipur.', 'A'),
(55, 'Organized One Week Short Term Course on \r\nEntrepreneurship and Personality Development \r\nfrom 4th – 8th November 2019', 'D'),
(59, 'Value cell page created', '12'),
(60, 'Department has Cyber Security Club, with eminent external experts from Police department, police university, forensic organizations, Law university, etc.', 'A'),
(61, 'Department has Industry consultation committee including experts from Facebook, Apple, Amazon, Infosys etc.', 'A'),
(62, 'Department has conducted Ten Days Free Basic Computer Course for Economically Backward Students of Nearby School to College Campus.', 'A'),
(63, 'Department has organized Two Days International Conference on Computational Intelligence and Emerging Power System (ICCIPS-2021) 09-10 March 2021 in association with Department of Electrical Engineering. These research papers will be published in the prestigious International Springer book series Algorithms for Intelligent Systems (AIS)', 'A'),
(64, 'Student team won 3rd prize of Rs 50000/- in the National level Hackathon held for the last 24 hours as part of HR conclave at Manipal University Jaipur organized by Govt of Rajasthan out of approximately 150 teams participating.', 'A'),
(65, '3 Teams participated from ECA in the National level\r\nHackathon held by Manipal National Hackathon Organized by Dept. Of higher and technical Education, GoR dated 16-17th December 2019 and 1 team stood second position.', 'A'),
(66, '44 students and faculty of CSE department got NPTEL certification in 2019-20.', 'A'),
(67, 'Organized Two Days National Level Online Hackathon\r\nCODETHON’21 on 17-18 Feb 2021', 'A'),
(68, 'Department students ( Shreeyansh Parihar, Mrinal Jain, Avi Saxena, Aniket Kushwaha, Nivesh Singh Chauhan ) under the guidance of Dr. Jyoti Gajrani developed “E-lecture App” for Technical Education Department. This is inaugurated by Mrs. Suchi Sharma, Ex- Secretary Department of Higher & Technical Education, Govt. of Rajasthan.', 'A'),
(69, 'Dr Jyoti Gajrani is nominated as member in BOS (Board of Studies) for Computer Science Engineering, Information Technology and Computer Application, Bikaner Technical University, Bikaner.', 'A'),
(70, 'Dr Neetu Sharma and Mr Satyanarayan Tazi are nominated for AICTE''s Leadership in Trading Excellance (LITE), a nation wide program to equip 50 colleges and 50 schools with leadership in teaching in excellence.', 'A'),
(71, 'The students of CS/IT namely Mr Salim Khan Chouhan CS Batch 2012-16, Ms Monika Kharinta IT Batch 2011-15, Mr Bhanu Pratap Singh CS Batch 2007-11 and Mr Mukesh Kumar CS Batch 2006-10 have added feather in college''s cap by clearing RAS 2018.', 'A'),
(73, 'Faculty development program on “Recent Trends in Electronics and\r\nTelecommunication” organized from 4/11/19 to 8/11/19 with a view to\r\ndevelop research idea among the faculty members.', 'B'),
(74, 'Mr. Diwakar Gautam (NPIU faculty) got CRS Project worth 11.65 Lakh\r\nrupees.', 'B'),
(75, 'Dr. Uma Shankar Modani is appointed as BOS member of ECE\r\nDepartment at BTU Bikaner in 2021.', 'B'),
(76, 'Dr. Rekha Mehra is appointed as invitee Member in BOS of ECE\r\nDepartment at BTU Bikaner in 2021.', 'B'),
(77, 'Parent teacher meeting conducted in the department on 30/11/19 and\r\n10/2/20 and Mentor has been appointed to the group of students with\r\nthe target to improve the performance of our students.', 'B'),
(78, 'Project Lab and PCB Fabrication Lab developed in the Department to\r\nenhance Research facility.', 'B'),
(79, 'Dr. Diwakar Gautam (NPIU Faculty) received PhD Degree from MNIT\r\nJaipur.', 'B'),
(80, 'Mr. Lalit Kumar Dusad submitted thesis to get PhD degree at MNIT\r\nJaipur.', 'B'),
(81, 'Three faculty members Dr. Rekha Mehra, Dr. Deepak Jhanwar and Mr.\r\nRavi Kumar Goyal have appeared in NPTEL course and exam conducted.\r\nby MHRD and they secure Elite certificate with name in topper list.', 'B'),
(82, 'Various Industrial Visits for B.tech students have been conducted.', 'B'),
(83, 'Students of the department (B.Tech, M.Tech and Ph.D) have\r\nattended Workshop on Solar Cell in IIT Mumbai under TEQIP III and they\r\nare using that training in their project.', 'B'),
(84, 'Strength of the department: \r\n• Highly qualified and senior faculties \r\n• Most of the Faculties have acquired their PhD/M.Tech. from the institutes of national importance such as IITs/NITs \r\n• Oldest Branch of this College and almost 100% admissions through JEE and LEEP \r\n• Good Academic records \r\n• Substantial research aptitude and outcome \r\n• Good placements (on/off campus) \r\n• Alumni are working in reputed organizations ', 'D'),
(86, 'SAE India Club of ECA gives opportunity to the students to learn with practical applications.', 'D'),
(87, 'By participating in various activities of Computer Aided Professional Skills Development Club, students are getting market ready', 'D'),
(88, 'MOU with UltraTech Cements \r\n\r\n	MOU has been signed with the objectives of furthering industry-academic relationship for mutual benefit, building fruitful and mutual relations. In this A center of Excellence for advance building material & Sustainable Development (COEABM&SD) will be setup at GECA, Ajmer in collaboration with ULTRATECH that will. organize skill development programs for the benefit of skilled and unskilled Labour, contractors and Builders.\r\n	Department will organize Technical seminars, workshops, conferences and training programmes in association with the ULTRATECH to provide the civil engineering community with the latest developments in research and developments of construction industry \r\n	ULTRATECH, in association with GECA- COEABM&SD shall arrange for industrial visits, seminars and guest lectures from Industry professionals/HR/Placement Agencies/Technology vendors to interface the students with global industry trends. \r\n	GECA- COEABM&SD to develop curriculum by including the latest materials, technologies in cement, RMC and building products and shall organizing industry visits to Cement & RMC plants, concrete roads/white topping/ mass housing project sites.\r\n\r\n\r\n', 'C'),
(89, 'B. Tech. Mechanical Final Year Project Work (2022) Published as a Book Chapter in Springer Proceedings entitled "Advances in Clean Energy and Sustainability (Vol. 2)" 2024. The research article is outcome of B. Tech. Final Year Project supervised by Dr. Chandan Sharma and Dr. Tarun K. Aseri of Mechanical Engineering Department. The students  (of session 2018-2022) involved in this Project are Dileep Septa, Ritesh Agrawal, Dheeraj Kumawat, Tanuj Gupta, Sunil Kumar. The poster of this article was presented at IIT Bombay in the 9th International Conference on Advances in Enrgy Research in December 2023.\r\n', 'D');
