INSERT INTO `labs` (`id`, `name`, `description`, `room`, `lab_incharge`, `lab_attendant`, `lab_technician`, `images`, `department`, `attendent`) VALUES
(1, 'Dynamics of Machine Lab', '&lt;div&gt;&lt;div style=&quot;font-family: Roboto, sans-serif;&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 15.3333px; font-family: Corbel, sans-serif;&quot;&gt;&lt;span style=&quot;font-weight: 700;&quot;&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;/span&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;Objective:&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/div&gt;&lt;div style=&quot;font-family: Roboto, sans-serif;&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 15.3333px; font-family: Corbel, sans-serif;&quot;&gt;&lt;span style=&quot;font-weight: 700;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/span&gt;&lt;/div&gt;&lt;span style=&quot;font-family: Roboto, sans-serif;&quot;&gt;DOM lab is to analyze the behavior of a given machine or mechanism when subjected to dynamic forces. Further the lab equipment’s will help to clear the fundamentals of dynamic force balance, transmissibility of forces, isolation of systems, vibrations, instrumentation and standards.&lt;/span&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;br&gt;\r\n&lt;br&gt;\r\n&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;b&gt;List Of Experiments:&lt;/b&gt;&lt;/span&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;b&gt;&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;div style=&quot;font-family: Roboto, sans-serif;&quot;&gt;&lt;span style=&quot;font-size: 10pt; line-height: 15.3333px; font-family: Corbel, sans-serif;&quot;&gt;&lt;span style=&quot;font-weight: 700;&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/div&gt;&lt;div style=&quot;font-family: Roboto, sans-serif; margin: 6pt 0in 0.0001pt 0.25in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;1.&amp;nbsp;&lt;span style=&quot;font-size:16px;&quot;&gt;To verify the torque relation for gyroscope.&lt;br&gt;\r\n2. To plot force vs. radius and lift vs. speed curves for governors.&lt;br&gt;\r\n3. To plot pressure distribution curves on a journal bearing.&lt;br&gt;\r\n4. To perform wheel balancing.&lt;br&gt;\r\n5. To perform static and dynamic balancing on balancing set up.&lt;br&gt;\r\n6. To determine mass moment of inertia of a flywheel.&lt;br&gt;\r\n7. Study of a lathe gear box.&lt;br&gt;\r\n8. Study of a sliding mesh automobile gear box.&lt;br&gt;\r\n9. Study of a planetary gear box.&lt;/span&gt;&lt;span style=&quot;line-height: 18.4px;&quot;&gt;&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;br&gt;\r\n&lt;br&gt;&lt;b&gt;&amp;nbsp; Outcome of Lab:&lt;/b&gt;&lt;/span&gt;&lt;div style=&quot;font-family: Roboto, sans-serif; margin: 6pt 0in 0.0001pt 0.25in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;span style=&quot;line-height: 18.4px;&quot;&gt;&lt;b&gt;&lt;/b&gt;&lt;/span&gt;&lt;/div&gt;&lt;div style=&quot;margin: 6pt 0in 0.0001pt 0.25in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;1. Students will be able to understand the working of different gear boxes&lt;br&gt;2. Students will be able to analyze curves of different centrifugal governors&lt;br&gt;3. Students will be able to perform static and dynamic balancing of rotating parts&lt;br&gt;4. Students will be able to understand the working of Gyroscope and verify the torque relation.&lt;/span&gt;&lt;div&gt;&lt;span style=&quot;line-height: 18.4px;&quot;&gt;&lt;span style=&quot;line-height: 115%;&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;', 'Workshop (WS-7/8)', 'Dr. Chandan Sharma', 'Mr. Shvji Ram', 'Mr. Rajesh Kumawat', 'images/a7a1267_DOM Lab.jpg,images/e47cf05_IMG_20170818_112624.jpg,images/7df2a3f_IMG_20170830_115701826.jpg,images/30a4588_IMG_20170830_115712171_HDR.jpg,images/a8e5a72_IMG_20170830_115721020_HDR.jpg', 'D', 'Mr. Gajanand Meena'),
(2, 'Material Science and Testing Lab', '&lt;div&gt;&lt;div&gt;&lt;span style=&quot;font-size:12.0pt;line-height:150%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;Material Testing Laboratory&lt;/span&gt;&lt;/b&gt;&lt;/span&gt;&lt;/div&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;br&gt;\r\nMaterial Science testing Laboratory is a back bone of Mechanical Engineering branch. The main focus area of testing is Destructive Testing. Different Testing are conducted to measure the stresses in Tension, Compression, Shearing, Impact etc. The changes of microstructure and measurement of mechanical properties is performed by microstructure examination and heat treatment of specimen.&amp;nbsp;&lt;/span&gt;&lt;div&gt;&lt;span style=&quot;font-size:12.0pt;line-height:150%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;&quot;&gt;&lt;div style=&quot;font-family: Calibri, Verdana, Helvetica, sans-serif;&quot;&gt;&lt;span style=&quot;font-size: 12pt; line-height: 17.12px; font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;/span&gt;&lt;/div&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;br&gt;&lt;b&gt;\r\n&lt;span style=&quot;font-size:16px;&quot;&gt;Objectives of the Laboratory:&lt;/span&gt;&lt;/b&gt;&lt;/span&gt;&lt;div&gt;&lt;span style=&quot;font-size:12.0pt;line-height:150%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;&quot;&gt;&lt;div&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/div&gt;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:107%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/div&gt;\r\n\r\n&lt;/div&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;Identification of engineering materials, examining their microstructure, properties, destructive testing of materials and different heat treatment processes.&lt;/span&gt;&lt;div&gt;&lt;span style=&quot;font-size:12.0pt;line-height:107%;\r\nfont-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:Calibri;\r\nmso-fareast-theme-font:minor-latin;mso-ansi-language:EN-US;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA;mso-bidi-font-weight:bold&quot;&gt;&lt;/span&gt;&lt;/div&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;br&gt;\r\n&lt;br&gt;&lt;b&gt;\r\nExperiments:&lt;/b&gt;&lt;/span&gt;&lt;div&gt;&lt;div&gt;&lt;span lang=&quot;EN-IN&quot; style=&quot;font-size: 12pt; line-height: 107%;&quot;&gt;&lt;font face=&quot;Symbol&quot;&gt;1.&lt;/font&gt;&lt;/span&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;Experiment on identification of engineering materials and their classification.&lt;/span&gt;&lt;/div&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;\r\n2.&amp;nbsp;&amp;nbsp;Specimen preparation for microscopic examination.&lt;br&gt;\r\n3.&amp;nbsp;&amp;nbsp;Microstructure examination of different given specimens.&lt;br&gt;\r\n4.&amp;nbsp;Heat treatment experiment for annealing, normalizing, quenching purpose.&lt;br&gt;\r\n5. Experiment on Impact, fatigue, creep testing machines.&lt;/span&gt;&lt;/div&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;br&gt;\r\n&lt;br&gt;\r\n&lt;br&gt;&lt;b&gt;\r\nOutcomes of the Laboratory:&lt;/b&gt;&lt;/span&gt;&lt;div&gt;&lt;div&gt;&lt;b&gt;&lt;span lang=&quot;EN-IN&quot; style=&quot;font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:107%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;&quot;&gt;&lt;/span&gt;&lt;/b&gt;&lt;/div&gt;&lt;/div&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&l