ial&amp;nbsp; compression Test&lt;/li&gt;&lt;li&gt;Consolidation Test&lt;/li&gt;&lt;li&gt;Unconfined Compression Test&lt;/li&gt;&lt;li&gt;Laboratory Vane shear Test&lt;/li&gt;&lt;/ul&gt;', 'C-20', '', '', '', 'images/e3d3df4_IMG-20190204-WA0014.jpg,images/322e03b_IMG-20190204-WA0008.jpg,images/a212e4d_IMG-20190204-WA0010.jpg,images/b5ca8d2_IMG-20190204-WA0012.jpg', 'C', ''),
