lt;/span&gt;&lt;span none=&quot;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span none=&quot;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span none=&quot;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span none=&quot;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span none=&quot;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;/div&gt;&lt;ul style=&quot;color: rgb(54, 71, 75); font-family: Tahoma, Geneva, sans-serif; font-size: 12px; text-align: justify;&quot;&gt;&lt;li&gt;Pocket compass, Alidade, Planimeter, Measuring tapes, Chains, Ranging rods, Optical squares, Cross staffs, Pegs, Arrows, Ranging Rods etc.&lt;/li&gt;&lt;/ul&gt;&lt;div&gt;&lt;strong&gt;Excercises&amp;nbsp;&amp;nbsp;Conducted&lt;/strong&gt;&lt;/div&gt;&lt;ul style=&quot;text-align: justify;&quot;&gt;&lt;li style=&quot;color: rgb(54, 71, 75); font-family: Tahoma, Geneva, sans-serif; font-size: 12px;&quot;&gt;Ranging and fixing anging of survey station&amp;nbsp;&lt;/li&gt;&lt;li style=&quot;color: rgb(54, 71, 75); font-family: Tahoma, Geneva, sans-serif; font-size: 12px;&quot;&gt;Chain surveying – Traversing and plotting using chain/tape&lt;/li&gt;&lt;li style=&quot;color: rgb(54, 71, 75); font-family: Tahoma, Geneva, sans-serif; font-size: 12px;&quot;&gt;Compass surveying – Traversing and plotting using chain and prismatic/surveyor compass; Measurement of bearing of lines&amp;nbsp;&lt;/li&gt;&lt;li style=&quot;color: rgb(54, 71, 75); font-family: Tahoma, Geneva, sans-serif; font-size: 12px;&quot;&gt;Plane table surveying – Radiation and intersection methods, solving three point problem, solving two point problem and traversing&lt;/li&gt;&lt;li style=&quot;color: rgb(54, 71, 75); font-family: Tahoma, Geneva, sans-serif; font-size: 12px;&quot;&gt;Levelling – : Using Tilting/ Dumpy/ Auto Level&amp;nbsp;&lt;/li&gt;&lt;li style=&quot;color: rgb(54, 71, 75); font-family: Tahoma, Geneva, sans-serif; font-size: 12px;&quot;&gt;Fly levelling, Profile Levelling check levelling&amp;nbsp;and cross sectioning, contour surveying&lt;/li&gt;&lt;li style=&quot;color: rgb(54, 71, 75); font-family: Tahoma, Geneva, sans-serif; font-size: 12px;&quot;&gt;Theodolite surveying – Horizontal angle (repetition and reiteration), computation of heights and distances by single plane method and double plane method, computation of heights and distances by using subtense bar&lt;/li&gt;&lt;li style=&quot;color: rgb(54, 71, 75); font-family: Tahoma, Geneva, sans-serif; font-size: 12px;&quot;&gt;Tacheometric surveying - Determination of tacheometric constants, computation of heights and distances by stadia tacheometry and tangential tacheometry&lt;/li&gt;&lt;li style=&quot;color: rgb(54, 71, 75); font-family: Tahoma, Geneva, sans-serif; font-size: 12px;&quot;&gt;Setting out of simple curves – Linear and angular methods&lt;/li&gt;&lt;li style=&quot;color: rgb(54, 71, 75); font-family: Tahoma, Geneva, sans-serif; font-size: 12px;&quot;&gt;Total station and EDM – Demonstration to setup and operate a total station and EDM&lt;/li&gt;&lt;li style=&quot;color: rgb(54, 71, 75); font-family: Tahoma, Geneva, sans-serif; font-size: 12px;&quot;&gt;Trigonometric Levelling: To determine the Height of an object by&amp;nbsp; trigonometriclevelling: a. By using Instruments in same vertical plane. b. By using Instruments in different vertical plane&lt;/li&gt;&lt;/ul&gt;', 'C-21', '', '', '', 'images/05d7bbc_1.jpg,images/2ff7606_2.jpg,images/e4b33db_3.jpg,images/7c95eaf_4.jpg,images/03b6e28_5.jpg,images/a09a8fa_6.jpg', 'C', ''),
(9, 'Geology Lab', '&lt;div&gt;&lt;span style=&quot;color: rgb(28, 41, 87); font-family: Verdana, Tahoma, &amp;quot;DejaVu Sans&amp;quot;, sans-serif; font-size: 11px;&quot;&gt;This&amp;nbsp; lab provides a hands-on survey of the fundamentals of physical geology. Lab introduce the identification and interpretation of rocks and minerals. We use topographic and contour maps to analyze and understand the basic features.&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span style=&quot;color: rgb(28, 41, 87); font-family: Verdana, Tahoma, &amp;quot;DejaVu Sans&amp;quot;, sans-serif; font-size: 11px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;div&gt;&lt;strong&gt;Major Equipments&lt;/strong&gt;&lt;/div&gt;&lt;ul style=&quot;color: rgb(54, 71, 75); font-family: Tahoma, Geneva, sans-serif; font-size: 12px; text-align: justify;&quot;&gt;&lt;li&gt;Mineral Samples&lt;/li&gt;&lt;li&gt;Rock Samples&lt;/li&gt;&lt;li&gt;Mohr Scale kit&lt;/li&gt;&lt;li&gt;Magnifying Lense&lt;/li&gt;&lt;li&gt;Streak/lusture Plate&lt;/li&gt;&lt;/ul&gt;&lt;div&gt;&lt;strong&gt;&lt;span id=&quot;cke_bm_120S&quot; none=&quot;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span id=&quot;cke_bm_121S&quot; none=&quot;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span id=&quot;cke_bm_122S&quot; none=&quot;&quot;&gt;&amp;nbsp;&lt;/span&gt;Experiments&amp;nbsp; Conducted&lt;/strong&gt;&lt;span style=&quot;color: rgb(54, 71, 75); font-family: Tahoma, Geneva, sans-serif; font-size: 12px; text-align: justify;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/div&gt;&lt;ul style=&quot;text-align: justify;&quot;&gt;&lt;li style=&quot;&quot;&gt;&lt;font color=&quot;#36474b&quot; face=&quot;Tahoma, Geneva, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Physical Properties of Minerals&lt;/span&gt;&lt;/font&gt;&lt;/li&gt;&lt;li style=&quot;&quot;&gt;&lt;font color=&quot;#36474b&quot; face=&quot;Tahoma, Geneva, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Physical Properties of Rocks&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/li&gt;&lt;li style=&quot;&quot;&gt;&lt;font color=&quot;#36474b&quot; face=&quot;Tahoma, Geneva, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Identification of Minerals in Hand Specimen&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/li&gt;&lt;li style=&quot;&quot;&gt;&lt;font color=&quot;#36474b&quot; face=&quot;Tahoma, Geneva, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Identification of Rocks in Hand Specimen&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/li&gt;&lt;li style=&quot;&quot;&gt;&lt;font color=&quot;#36474b&quot; face=&quot;Tahoma, Geneva, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Identification of Geological features&lt;/span&gt;&lt;/font&gt;&lt;/li&gt;&lt;li style=&quot;&quot;&gt;&lt;font color=&quot;#36474b&quot; face=&quot;Tahoma, Geneva, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Interpretation of Geological Map&lt;/span&gt;&lt;/font&gt;&lt;/li&gt;&lt;li style=&quot;&quot;&gt;&lt;font color=&quot;#36474b&quot; face=&quot;Tahoma, Geneva, sans-serif&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Dip &amp;amp; Strike Problems&lt;/span&gt;&lt;/font&gt;&lt;/li&gt;&lt;/ul&gt;&lt;/div&gt;', 'C-13', '', '', '', 'images/c77ca1e_IMG-20190204-WA0007.jpg,images/d899354_IMG-20190204-WA0009.jpg,images/c70a152_IMG-20190204-WA0011.jpg,images/725cc2b_IMG-20190204-WA0013.jpg', 'C', ''),
(10, 'Computer Aided Manufacturing (CAM) Lab', '&lt;div&gt;&lt;div&gt;&lt;div&gt;&lt;span lang=&quot;EN-IN&quot; style=&quot;font-size:\r\n12.0pt;line-height:150%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;&quot;&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;b&gt;Computer Aided Manufacturing Laboratory&amp;nbsp;&lt;/b&gt;&lt;/span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;div&gt;&lt;b&gt;&lt;span lang=&quot;EN-IN&quot; style=&quot;font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:107%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;&quot;&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/div&gt;&lt;div&gt;&lt;b&gt;&lt;span lang=&quot;EN-IN&quot; style=&quot;font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:107%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;&quot;&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/div&gt;&lt;div&gt;&lt;b&gt;&lt;span lang=&quot;EN-IN&quot; style=&quot;font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:107%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;&quot;&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;Outcomes of the Laboratory:&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/div&gt;&lt;/div&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;br&gt;\r\n1. Learn the basics of the Computer Numerical Control (CNC) Machines.&lt;br&gt;\r\n2. Apply knowledge of computer aided process planning, feature and group technology, and inventory control in manufacturing processes. &amp;nbsp;&lt;br&gt;\r\n3. Apply the concepts/components of computer integrated manufacturing and integrate them in a coordinated fashion.&lt;br&gt;\r\n4. To understand the role of Computer Aided Production Management Systems.&lt;/span&gt;&lt;div&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;5. MasterCAM Educational Suit 2020 simulation software with 10 users&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;6. Availability of two server/workstation for high computation simulation (Xeon - 24C/48T, 96GB RAM)&lt;br&gt;&lt;/span&gt;&lt;div&gt;&lt;span lang=&quot;EN-IN&quot; style=&quot;font-size:12.0pt;mso-bidi-font-size:\r\n10.0pt;line-height:107%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:\r\n&amp;quot;Times New Roman&amp;quot;;color:#2C2C2C;mso-ansi-language:EN-IN;mso-fareast-language:\r\nEN-IN;mso-bidi-language:AR-SA&quot;&gt;&lt;span lang=&quot;EN-IN&quot; style=&quot;font-size: 12pt; line-height: 107%;&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;', 'Workshop (WS-3/4)', 'Mr. Tarun Kumar Aseri', 'Mr. Uttam Singh', 'Mr. Rajesh Kumawat', 'images/f7eb412_CAM Lab Servers.jpg,images/eeb835d_Licensed Software.jpg,images/7655347_WhatsApp Image 2017-08-29 at 12.57.06 PM.jpeg,images/a288952_WhatsApp Image 2017-08-29 at 12.57.07 PM.jpeg,images/b413663_WhatsApp Image 2017-08-29 at 12.57.16 PM.jpeg', 'D', '-'),
(11, 'Heat and Mass Transfer Lab', '&lt;div&gt;&lt;br&gt;&lt;/div&gt;', 'Workshop (WS-1/2)', 'Dr. Rohit Misra', 'Mr. Shvji Ram', 'Mr. Rajesh Kumawat', 'images/c557e00_IMG_20170818_094722.jpg,images/f455672_IMG_20170818_094733.jpg,images/57e21b6_IMG_20170818_094805.jpg', 'D', '-'),
(12, 'Vibration Engineering Lab', '&lt;div&gt;&lt;br&gt;&lt;/div&gt;', 'Workshop (WS-7/8)', 'Dr. Alok Khatri', 'Mr. Uttam Singh', 'Mr. Govind Sharma', 'images/019cdb6_IMG_20170830_115929355.jpg', 'D', '-'),
(13, 'Industrial Engineering Lab', '&lt;div&gt;&lt;div&gt;&lt;span style=&quot;line-height: 115%;&quot;&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;b&gt;Industrial Engineering laboratory&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;\r\n&lt;br&gt;\r\nIndustrial engineering (IE) is a branch of engineering which deals with the optimization of complex processes, systems or organizations by eliminating waste of time, money, materials, man-hours, machine time, energy and other resources that do not generate value. In previous century, focus of IE was to carry out work and method study using a stop watch. However, nowadays, its focus is to figure out non-value added processes/activities in the existing system and to design the improved, more productive and leaner systems.&lt;/span&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;br&gt;\r\n&lt;br&gt;&lt;b&gt;\r\nCourse Objective: &lt;/b&gt;&lt;/span&gt;&lt;div&gt;&lt;div&gt;&lt;div&gt;&lt;span lang=&quot;EN-IN&quot; style=&quot;font-size:12.0pt;line-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;&quot;&gt;&lt;font color=&quot;#000000&quot;&gt;&lt;/font&gt;To understand and apply on-line and off-line quality control techniques to\r\nassure desired quality.&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;br&gt;\r\n&lt;br&gt;&lt;b&gt;\r\nCourse Outcomes:&lt;/b&gt;&lt;/span&gt;&lt;div&gt;&lt;span lang=&quot;EN-IN&quot; style=&quot;font-size:12.0pt;line-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;&quot;&gt;&lt;font color=&quot;#000000&quot;&gt;&lt;span lang=&quot;EN-IN&quot; style=&quot;font-size: 12pt; line-height: 115%; font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;&lt;/span&gt;&lt;/font&gt;&lt;span lang=&quot;EN-IN&quot; style=&quot;font-size: 12pt; line-height: 115%; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: red;&quot;&gt;&amp;nbsp;&lt;/span&gt;At the end of the course, the student will be able to:&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span lang=&quot;EN-IN&quot; style=&quot;font-size:12.0pt;line-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span lang=&quot;EN-IN&quot; style=&quot;font-size:12.0pt;line-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;&quot;&gt;1.&amp;nbsp;&lt;/span&gt;&lt;span lang=&quot;EN-IN&quot; style=&quot;font-size: 12pt; line-height: 115%; font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;Design variable control charts for &lt;/span&gt;&lt;span style=&quot;font-size: 12pt; line-height: 115%; font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;the given quality\r\ncharacteristic &lt;/span&gt;&lt;span lang=&quot;EN-IN&quot; style=&quot;font-size: 12pt; line-height: 115%; font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;using Excel and &lt;/span&gt;&lt;span style=&quot;font-size: 12pt; line-height: 115%; font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;evaluate the impact of shift in process mean and\r\nchange in process variability on the state of statistical quality control and\r\nprocess capability.&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span style=&quot;font-size: 12pt; line-height: 115%; font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;2.&amp;nbsp;&lt;/span&gt;&lt;span lang=&quot;EN-IN&quot; style=&quot;font-size: 12pt; line-height: 115%; font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;Design attribute control charts for &lt;/span&gt;&lt;span style=&quot;font-size: 12pt; line-height: 115%; font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;the given quality\r\ncharacteristic &lt;/span&gt;&lt;span lang=&quot;EN-IN&quot; style=&quot;font-size: 12pt; line-height: 115%; font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;using Excel and &lt;/span&gt;&lt;span style=&quot;font-size: 12pt; line-height: 115%; font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;evaluate the impact of change in fraction defective\r\nor number of defects on the state of statistical quality control.&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span style=&quot;font-size: 12pt; line-height: 115%; font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;3.&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: &amp;quot;Times New Roman&amp;quot;, serif; font-size: 12pt;&quot;&gt;Create an appropriate Single Sampling Plan (SSP)\r\nwith the help of OC curve for given sampling attributes.&lt;/span&gt;&lt;/div&gt;&lt;span style=&quot;font-size:12.0pt;line-height:115%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;\r\nmso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:\r\nEN-IN;mso-fareast-language:EN-US;mso-bidi-language:HI&quot;&gt;&lt;/span&gt;', 'NB-226', 'Dr. Devendra Choudhary', '-', 'Mr. Uttam Singh', 'images/e5f6d16_1.jpg,images/013cea9_2.jpg,images/c6cc6d6_3.jpg,images/c55ead0_4.jpg', 'D', '-'),
(14, 'Production Engineering Lab', '&lt;div&gt;About Lab&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;Course Objective&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;List of Experiments&lt;/div&gt;', 'Workshop (WS-9/10)', 'Mr. Yogesh K Gupta', 'Mr. Shvji Ram', 'Mr. Devishankar', 'images/9ab9bcb_IMG_20170818_112937.jpg,images/d05acd9_IMG_20170818_113136.jpg,images/b63a9cb_IMG_20170818_113152.jpg,images/4d04665_IMG_20170818_113228.jpg,images/cdb1b86_IMG_20170818_113252.jpg', 'D', '-'),
