:Calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:\r\nEN-IN;mso-fareast-language:EN-US;mso-bidi-language:AR-SA&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span lang=&quot;EN-IN&quot; style=&quot;font-size: 11pt; line-height: 107%;&quot;&gt;&lt;div style=&quot;font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;&lt;b&gt;&lt;span lang=&quot;EN-IN&quot; style=&quot;font-size: 12pt; line-height: 107%;&quot;&gt;Outcomes of the Laboratory:&lt;/span&gt;&lt;/b&gt;&lt;/div&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;font face=&quot;Georgia&quot;&gt;\r\n&lt;br&gt;\r\n&lt;/font&gt;&lt;/span&gt;&lt;/span&gt;&lt;/div&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;font face=&quot;Georgia&quot;&gt;1. Able to use software like AutoCAD, Invertor/ Pro E/ Uni-graphics.&lt;br&gt;\r\n2. Learned basic concept to drawing, edit, dimension, hatching etc. to develop 2D &amp;amp; 3D Modelling.&lt;br&gt;\r\n3. Able to make 3D modelling, Assembling, modification &amp;amp; manipulation along with detailing.&lt;br&gt;\r\n4. Able to prepare surface modelling and sheet metal&amp;nbsp; operations through various exercises.&lt;/font&gt;&lt;/span&gt;&lt;div&gt;&lt;span lang=&quot;EN-IN&quot; style=&quot;font-size: 11pt; line-height: 107%;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;font face=&quot;Times New Roman&quot;&gt;&lt;/font&gt;&lt;/span&gt;&lt;div style=&quot;font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;&lt;span lang=&quot;EN-IN&quot; style=&quot;font-size:11.0pt;line-height:\r\n107%;font-family:&amp;quot;Calibri&amp;quot;,&amp;quot;sans-serif&amp;quot;;mso-ascii-theme-font:minor-latin;\r\nmso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;mso-hansi-theme-font:\r\nminor-latin;mso-bidi-font-family:&amp;quot;Times New Roman&amp;quot;;mso-bidi-theme-font:minor-bidi;\r\nmso-ansi-language:EN-IN;mso-fareast-language:EN-US;mso-bidi-language:AR-SA&quot;&gt;&lt;/span&gt;&lt;/div&gt;&lt;/span&gt;&lt;/div&gt;', 'CAD Lab', 'Dr. Ankur Pareek', 'Mr. Uttam Singh', 'Mr. Rajesh Kumawat', 'images/6135940_IMG_20170818_093919.jpg,images/d27c82f_WhatsApp Image 2017-08-29 at 12.57.16 PM.jpeg,images/11d76a7_WhatsApp Image 2017-08-29 at 12.57.57 PM (1).jpeg', 'D', 'Mr. Rajesh Kumawat'),
(26, 'Thermal Engineering Lab', '&lt;div&gt;&lt;div&gt;&lt;span style=&quot;line-height: 107%;&quot;&gt;&lt;div style=&quot;font-family: &amp;quot;Times New Roman&amp;quot;, serif; font-size: 12pt;&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;line-height:107%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;\r\nmso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:\r\nEN-IN;mso-fareast-language:EN-US;mso-bidi-language:AR-SA&quot;&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;Thermal Engineering Laboratory&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/div&gt;&lt;div style=&quot;font-family: &amp;quot;Times New Roman&amp;quot;, serif; font-size: 12pt;&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:107%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/b&gt;&lt;/div&gt;&lt;div style=&quot;font-family: &amp;quot;Times New Roman&amp;quot;, serif; font-size: 12pt;&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:107%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/b&gt;&lt;/div&gt;&lt;div style=&quot;&quot;&gt;&lt;span style=&quot;line-height: 107%;&quot;&gt;&lt;b&gt;&lt;font&gt;&lt;span style=&quot;font-size: 12pt;&quot;&gt;Objectives of the\r\nLaboratory:&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/b&gt;&lt;/span&gt;&lt;/div&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;\r\n&lt;br&gt;\r\nThe objective of the thermal engineering laboratory is to introduce the student the fundamental theories and the industrial applications of thermodynamics, heat transfer, and fluid mechanics. This laboratory supports the courses for the undergraduate and graduate studies. Moreover, this laboratory also supports the advanced research in the area of thermal engineering, heat transfer, and fluid mechanics.&lt;/span&gt;&lt;div style=&quot;&quot;&gt;&lt;span style=&quot;text-align: justify;&quot;&gt;&lt;/span&gt;&lt;/div&gt;&lt;div style=&quot;font-family: &amp;quot;Times New Roman&amp;quot;, serif; font-size: 12pt;&quot;&gt;&lt;br&gt;&lt;/div&gt;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:107%;\r\nfont-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:Calibri;\r\nmso-fareast-theme-font:minor-latin;mso-ansi-language:EN-IN;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/b&gt;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:107%;\r\nfont-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:Calibri;\r\nmso-fareast-theme-font:minor-latin;mso-ansi-language:EN-IN;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/b&gt;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:107%;\r\nfont-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:Calibri;\r\nmso-fareast-theme-font:minor-latin;mso-ansi-language:EN-IN;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA&quot;&gt;Proposed Experiments:&lt;/span&gt;&lt;/b&gt;&lt;/span&gt;&lt;/div&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;\r\n1. Study of working of four stroke petrol engine and four stroke diesel engine with the help of cut section models.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;\r\n2. Study of working of two stroke petrol and two stroke diesel engine with the help of cut section models.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;\r\n3. To draw valve timing diagram for a single cylinder diesel engine.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;\r\n4. Study of various types of boilers.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;\r\n5. Study of fuel supply system of a petrol engine (fuel pump and simple carburetor).&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;\r\n6. To perform constant speed load test on a single cylinder diesel engine and to plot performance curves: indicated thermal efficiency,&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;brake thermal efficiency, mechanical efficiency Vs. Brake power, and heat balance sheet.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;\r\n7. Determination of dryness fraction of steam.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;\r\n8. Performance characteristics of Francis turbine.&lt;/span&gt;&lt;div&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;&lt;span style=&quot;font-size: 11pt; line-height: 107%; font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;b&gt;&lt;br&gt;&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;b&gt;&lt;br&gt;&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;b&gt;&lt;br&gt;&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;/div&gt;&lt;div&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;b&gt;Outcomes of the Laboratory:&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;br&gt;&lt;ol&gt;&lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;\r\nAnalyze&amp;nbsp; the basic functions of&amp;nbsp; internal combustion engines&lt;/span&gt;&lt;/li&gt;&lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;\r\nDefine the tonnage capacity in refrigeration &amp;amp; air conditioning.&lt;/span&gt;&lt;/li&gt;&lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;\r\nUnderstand basics of turbines &amp;amp; pumps.&lt;/span&gt;&lt;/li&gt;&lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;\r\nUnderstand about steam &amp;amp; steam power plants.&lt;/span&gt;&lt;/li&gt;&lt;/ol&gt;&lt;/span&gt;&lt;div&gt;&lt;span style=&quot;font-size:11.0pt;line-height:\r\n107%;font-family:&amp;quot;Times New Roman&amp;quot;,&amp;quot;serif&amp;quot;;mso-fareast-font-family:Calibri;\r\nmso-fareast-theme-font:minor-latin;mso-ansi-language:EN-IN;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA&quot;&gt;&lt;/span&gt;&lt;/div&gt;', 'Thermal Lab', 'Dr. D.K. Jamuwa', 'Mr. Shvji Ram', 'Mr. Devi Shankar', 'images/f9e2fbc_IMG_20170818_094151.jpg,images/08e546f_IMG_20170818_094208.jpg,images/b1605d9_IMG_20170818_094243.jpg,images/7ed1388_IMG_20170818_094258.jpg', 'D', 'Subhas Saini'),
