(32, 'Power System Lab', '&lt;div&gt;&lt;h5 align=&quot;center&quot; style=&quot;margin-top:7.5pt;margin-right:0in;margin-bottom:7.5pt;\r\nmargin-left:0in;text-align:center;background:#F2F2F2&quot;&gt;&lt;span style=&quot;font-size: 10.5pt; font-family: &amp;quot;Lucida Sans Unicode&amp;quot;, sans-serif;&quot;&gt;&lt;b&gt;Year of Established&lt;/b&gt;: 2017&lt;br&gt;&lt;b&gt;\r\nMajor Equipment&lt;/b&gt;: Over Current Relay Study System, Percentage Biased\r\nDifferential Relay System, Over/Under Frequency Relay Study System, Sequence\r\nCurrents of 3-phase Transformer, Calibration of current transformer, Gas\r\nActuated Buccholg Relay System&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/h5&gt;&lt;/div&gt;', 'EE 11', 'Sh. Ajay Agarwal and Sh. Dev Pratap Mahto', 'Mrs. Beena', 'Sh. Parveen Kumar Sharma', 'images/e31b8b4_power system.png', 'F', 'Mrs. Beena'),
(33, 'Environmental Engineering Lab.', '&lt;div style=&quot;font-family: &amp;quot;Source Sans Pro&amp;quot;, &amp;quot;Lucida Sans Unicode&amp;quot;, &amp;quot;Lucida Grande&amp;quot;, sans-serif; font-size: 14px;&quot;&gt;&lt;strong&gt;Major&amp;nbsp;&lt;/strong&gt;&lt;b&gt;Equipments&lt;/b&gt;&lt;/div&gt;&lt;ul style=&quot;margin-top: 0px; color: rgb(54, 71, 75); font-family: Tahoma, Geneva, sans-serif; font-size: 12px; text-align: justify;&quot;&gt;&lt;li&gt;&lt;br&gt;&lt;/li&gt;&lt;/ul&gt;&lt;div style=&quot;font-family: &amp;quot;Source Sans Pro&amp;quot;, &amp;quot;Lucida Sans Unicode&amp;quot;, &amp;quot;Lucida Grande&amp;quot;, sans-serif; font-size: 14px;&quot;&gt;&lt;strong&gt;Experiments&amp;nbsp; Conducted&lt;/strong&gt;&amp;nbsp;&amp;nbsp;&lt;/div&gt;&lt;ul style=&quot;margin-top: 0px; color: rgb(54, 71, 75); font-family: Tahoma, Geneva, sans-serif; font-size: 12px; text-align: justify;&quot;&gt;&lt;li&gt;&lt;br&gt;&lt;/li&gt;&lt;/ul&gt;', 'C-13', '', '', '', 'images/fde9a24_env sample.png', 'C', ''),
(34, 'Microprocessor and Microcontroller Lab', '&lt;div&gt;&lt;div&gt;&lt;span style=&quot;font-size: 12pt; line-height: 150%; font-family: &amp;quot;Times New Roman&amp;quot;, serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;Microprocessors\r\nand Microcontrollers laboratory helps the students to develop their knowledge\r\non processor architecture and the programming skills. This laboratory houses\r\nthe hardware which includes 8085 Microprocessor trainer kits, 8086\r\nMicroprocessor trainer kits, 8051 Microcontroller trainer kits, interfacing\r\ncards and software Keil-51. This laboratory provides hands-on experience to\r\ninterface I/O devices, perform A/D and D/A conversions, design digital clock,\r\ntraffic light control system etc., The features and facilities available in\r\nthis laboratory helps the students to do their projects and enhance their\r\nknowledge on the latest trends and technologies. Students from other branches of\r\nengineering also make use of this laboratory and develop their skills in the\r\nfield of Microprocessors &amp;amp; Microcontrollers and their applications.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/div&gt;\r\n\r\n&lt;div&gt;&lt;b&gt;&lt;span style=&quot;font-size:11.5pt;font-family:\r\n&amp;quot;Times New Roman&amp;quot;,serif;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;border:none windowtext 1.0pt;\r\nmso-border-alt:none windowtext 0in;padding:0in&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/b&gt;&lt;/div&gt;\r\n\r\n&lt;div&gt;&lt;b&gt;&lt;span style=&quot;font-size:11.5pt;font-family:\r\n&amp;quot;Times New Roman&amp;quot;,serif;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;border:none windowtext 1.0pt;\r\nmso-border-alt:none windowtext 0in;padding:0in&quot;&gt;Objectives: &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/div&gt;\r\n\r\n&lt;div&gt;&lt;b&gt;&lt;span style=&quot;font-size:11.5pt;font-family:\r\n&amp;quot;Times New Roman&amp;quot;,serif;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;border:none windowtext 1.0pt;\r\nmso-border-alt:none windowtext 0in;padding:0in&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/b&gt;&lt;/div&gt;\r\n\r\n&lt;div&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;font-size:12.0pt;line-height:150%;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol&quot;&gt;·&lt;span style=&quot;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &amp;quot;Times New Roman&amp;quot;;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;font-size:12.0pt;line-height:150%;\r\nfont-family:&amp;quot;Times New Roman&amp;quot;,serif&quot;&gt;Familiarize and understand of the architecture\r\nof 8085/8086 processor and 8051 controllers, assembling language programming and\r\ninterfacing with various modules&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/div&gt;\r\n\r\n&lt;div&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;font-size:12.0pt;line-height:150%;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol;border:none windowtext 1.0pt;mso-border-alt:\r\nnone windowtext 0in;padding:0in;mso-bidi-font-weight:bold&quot;&gt;·&lt;span style=&quot;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &amp;quot;Times New Roman&amp;quot;;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;font-size:12.0pt;line-height:150%;\r\nfont-family:&amp;quot;Times New Roman&amp;quot;,serif&quot;&gt;Student able to do any type of embedded\r\nsystems, industrial and real-time applications by knowing the concepts of\r\nMicroprocessor and Microcontrollers.&lt;/span&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:150%;font-family:&amp;quot;Times New Roman&amp;quot;,serif;mso-fareast-font-family:\r\n&amp;quot;Times New Roman&amp;quot;;border:none windowtext 1.0pt;mso-border-alt:none windowtext 0in;\r\npadding:0in&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/div&gt;&lt;/div&gt;', 'S-3, A', 'Dr. C P Jain', 'Mr. Kanaram', 'Mrs. Rashmi', 'images/5333f56_20180906_094319.jpg', 'E', 'Mr. Kanaram'),
(35, 'Computational (Simulation) Lab', '&lt;div&gt;&lt;div&gt;This the laboratory is to provide the computational facilities to M.Tech, B.E students\r\nto undertake their thesis or Project work. Presently 25 computers are providing\r\n24-hour internet access and computational facility on MATLAB and Labview.&lt;o:p&gt;&lt;/o:p&gt;&lt;/div&gt;\r\n\r\n&lt;div&gt;&lt;strong&gt;&lt;span style=&quot;font-size:11.5pt;border:none windowtext 1.0pt;\r\nmso-border-alt:none windowtext 0in;padding:0in&quot;&gt;Objectives&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size:11.5pt&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/div&gt;\r\n\r\n&lt;div&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/div&gt;\r\n\r\n&lt;div&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;font-size:10.0pt;mso-bidi-font-size:\r\n12.0pt;line-height:150%;font-family:&amp;quot;Courier New&amp;quot;;mso-fareast-font-family:&amp;quot;Courier New&amp;quot;&quot;&gt;o&lt;span style=&quot;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &amp;quot;Times New Roman&amp;quot;;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;font-size:12.0pt;line-height:150%;\r\nfont-family:&amp;quot;Times New Roman&amp;quot;,serif&quot;&gt;Developing numerical, computational and\r\nlogical skills relevant for the solution of theoretical and experimental\r\nelectrical, instrumentation and control problems&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/div&gt;\r\n\r\n&lt;div&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;font-size:10.0pt;mso-bidi-font-size:\r\n12.0pt;line-height:150%;font-family:&amp;quot;Courier New&amp;quot;;mso-fareast-font-family:&amp;quot;Courier New&amp;quot;&quot;&gt;o&lt;span style=&quot;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &amp;quot;Times New Roman&amp;quot;;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;font-size:12.0pt;line-height:150%;\r\nfont-family:&amp;quot;Times New Roman&amp;quot;,serif&quot;&gt;Hands on experience to students for the\r\nusage of C language, MATLAB, Lab VIEW platform to verify and witness the\r\nrelevant theoretical concepts.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/div&gt;&lt;/div&gt;', 'F 17', 'Dr H S Mewara', 'Mr. Kanaram', 'Mrs. Rashmi', 'images/bf580a7_20180906_095611.jpg', 'E', 'Mr. Kanaram'),
(36, 'Process Control Lab', '&lt;div&gt;&lt;div&gt;This the laboratory was one of the first laboratories established in the Electronic\r\ninstrumentation &amp;amp; control department. Process control is an integral part\r\nof any curriculum related to instrumentation engineering. This laboratory was\r\nestablished to make students aware of the basic fundamentals of practical\r\nprocess control. Various control viz. closed dc loop control, cascade control,\r\nratio control, PLC control are simulated/practically implemented to give the student a better understanding. Besides this, advanced hydraulic trainer kit\r\nand pneumatic trainer kit give inside view of hydraulic and pneumatic control\r\nprinciples. Controller Modules are procured in the laboratory to demonstrate\r\nvarious controller configurations.&lt;o:p&gt;&lt;/o:p&gt;&lt;/div&gt;\r\n\r\n&lt;div&gt;&lt;b&gt;Objectives &lt;o:p&gt;&lt;/o:p&gt;&lt;/b&gt;&lt;/div&gt;\r\n\r\n&lt;div&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol&quot;&gt;·&lt;span style=&quot;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &amp;quot;Times New Roman&amp;quot;;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;To control temperature, pressure, flow, level\r\nusing PC with the help of different control modes.&lt;o:p&gt;&lt;/o:p&gt;&lt;/div&gt;\r\n\r\n&lt;div&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol&quot;&gt;·&lt;span style=&quot;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &amp;quot;Times New Roman&amp;quot;;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;Design and implement controllers for various\r\nprocesses&lt;o:p&gt;&lt;/o:p&gt;&lt;/div&gt;&lt;/div&gt;', 'F-21', 'Dr. C P Jain', 'Mr. Kanaram', 'Mrs. Anita', 'images/fcbb3a1_20180906_095402.jpg', 'E', 'Mr. Kanaram'),
(37, 'Transducer Lab', '&lt;div&gt;&lt;div&gt;&lt;span style=&quot;font-size:11.5pt;line-height:150%&quot;&gt;Transducer Laboratory is equipped\r\nwith modern measurement instrumentation equipment’s, which helps the students\r\nto study the different mechanism of measurement of Temperature, pressure, density,\r\nhumidity, displacement, force, speed, torque, stress, etc. Students learn to\r\nmeasure as well as develop the skill to calibrate the temperature and pressure\r\ngauges etc.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/div&gt;\r\n\r\n&lt;div&gt;&lt;strong&gt;&lt;span style=&quot;font-size:11.5pt;border:none windowtext 1.0pt;\r\nmso-border-alt:none windowtext 0in;padding:0in&quot;&gt;Objectives &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/div&gt;\r\n\r\n&lt;div&gt;&lt;span style=&quot;font-size:11.5pt&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/div&gt;\r\n\r\n&lt;div&gt;&lt;em&gt;To\r\nprovide a basic understanding of operational characteristics and\r\napplications of various sensors and transducers.&lt;/em&gt;&lt;em&gt;&lt;span style=&quot;border:none windowtext 1.0pt;mso-border-alt:none windowtext 0in;\r\npadding:0in;mso-bidi-font-weight:bold;font-style:normal;mso-bidi-font-style:\r\nitalic&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/em&gt;&lt;/div&gt;&lt;/div&gt;', 'S-3, B', 'Mr. Ajay Dadhich', 'Mr. Kanaram', 'Mrs. Rashmi', 'images/54792cb_20180906_095030.jpg', 'E', 'Mr. Kanaram');
INSERT INTO `labs` (`id`, `name`, `description`, `room`, `lab_incharge`, `lab_attendant`, `lab_technician`, `images`, `department`, `attendent`) VALUES
(38, 'Measurement &amp; Instrumentation Lab', '&lt;div&gt;&lt;div&gt;&lt;span style=&quot;font-size:12.0pt;line-height:150%;\r\nfont-family:&amp;quot;Times New Roman&amp;quot;,serif;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;Our\r\nMeasurements and Instrumentation Laboratory brings hands-on experience to us\r\nstudents through learning and applying engineering measurement techniques using\r\ndifferent types of transducers and measurement systems.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/div&gt;\r\n\r\n&lt;div&gt;&lt;span style=&quot;font-size:12.0pt;line-height:150%;\r\nfont-family:&amp;quot;Times New Roman&amp;quot;,serif;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;The\r\nmajor equipment in the laboratory includes:&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/div&gt;\r\n\r\n&lt;div&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;font-size:10.0pt;mso-bidi-font-size:12.0pt;line-height:150%;font-family:\r\nSymbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol&quot;&gt;·&lt;span style=&quot;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &amp;quot;Times New Roman&amp;quot;;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;font-size:12.0pt;line-height:150%;\r\nfont-family:&amp;quot;Times New Roman&amp;quot;,serif;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;transducers\r\nand instrumentation trainer kits&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/div&gt;\r\n\r\n&lt;div&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;font-size:10.0pt;mso-bidi-font-size:12.0pt;line-height:150%;font-family:\r\nSymbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol&quot;&gt;·&lt;span style=&quot;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &amp;quot;Times New Roman&amp;quot;;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;font-size:12.0pt;line-height:150%;\r\nfont-family:&amp;quot;Times New Roman&amp;quot;,serif;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;strain\r\ngauges, LVDTs, thermocouples, RTDs, digital thermometers, flowmeters, light\r\nsources and transducers&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/div&gt;\r\n\r\n&lt;div&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;font-size:10.0pt;mso-bidi-font-size:12.0pt;line-height:150%;font-family:\r\nSymbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol&quot;&gt;·&lt;span style=&quot;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &amp;quot;Times New Roman&amp;quot;;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;font-size:12.0pt;line-height:150%;\r\nfont-family:&amp;quot;Times New Roman&amp;quot;,serif;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;acceleration\r\nand displacement measurement devices&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/div&gt;\r\n\r\n&lt;div&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;font-size:10.0pt;mso-bidi-font-size:12.0pt;line-height:150%;font-family:\r\nSymbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol&quot;&gt;·&lt;span style=&quot;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &amp;quot;Times New Roman&amp;quot;;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;font-size:12.0pt;line-height:150%;\r\nfont-family:&amp;quot;Times New Roman&amp;quot;,serif;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;signal\r\ntransmission and conditioning systems&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/div&gt;\r\n\r\n&lt;div&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;font-size:10.0pt;mso-bidi-font-size:12.0pt;line-height:150%;font-family:\r\nSymbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol&quot;&gt;·&lt;span style=&quot;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &amp;quot;Times New Roman&amp;quot;;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;font-size:12.0pt;line-height:150%;\r\nfont-family:&amp;quot;Times New Roman&amp;quot;,serif;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;basic\r\nlaboratory equipment (multimeter, oscilloscopes, power supplies and function\r\ngenerators)&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/div&gt;\r\n\r\n&lt;div&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:150%;font-family:&amp;quot;Times New Roman&amp;quot;,serif;mso-fareast-font-family:\r\n&amp;quot;Times New Roman&amp;quot;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/b&gt;&lt;/div&gt;\r\n\r\n&lt;div&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:150%;font-family:&amp;quot;Times New Roman&amp;quot;,serif;mso-fareast-font-family:\r\n&amp;quot;Times New Roman&amp;quot;&quot;&gt;Objectives&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/div&gt;\r\n\r\n&lt;div&gt;&lt;span style=&quot;font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:150%;font-family:&amp;quot;Times New Roman&amp;quot;,serif&quot;&gt;To become familiar\r\nwith the instruments that will be used in the Measurement and instrumentation\r\nLab.&lt;/span&gt;&lt;b&gt;&lt;span style=&quot;font-size:14.0pt;\r\nmso-bidi-font-size:12.0pt;line-height:150%;font-family:&amp;quot;Times New Roman&amp;quot;,serif;\r\nmso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/div&gt;&lt;/div&gt;', 'S-3, A', 'Mr. Ajay Dadhich', 'Mr. Kanaram', 'Mrs. Rashmi', 'images/9c9a06d_20180906_094728.jpg', 'E', 'Mr. Kanaram'),
(39, 'Electronics Lab', '&lt;div&gt;&lt;div&gt;&lt;span style=&quot;font-size:12.0pt;line-height:150%;font-family:&amp;quot;Times New Roman&amp;quot;,serif;\r\nmso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;This laboratory is to impart\r\npractical knowledge, especially to degree students, of the basic electronic\r\ncomponents and their applications. Such as a diode, transistor, diac, triac,\r\nthyristors, and UJTs, etc.&amp;nbsp; This laboratory\r\nis equipped with various modules for characteristic curve analysis of the\r\nelectronic component and experimental setup of converters, inverters, choppers\r\nand speed control of dc motors. The consultancy work can be offered to related\r\nindustries.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/div&gt;\r\n\r\n&lt;div&gt;&lt;span style=&quot;font-size:11.5pt;font-family:&amp;quot;Times New Roman&amp;quot;,serif;mso-fareast-font-family:\r\n&amp;quot;Times New Roman&amp;quot;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/div&gt;\r\n\r\n&lt;div&gt;&lt;b&gt;Objectives&lt;o:p&gt;&lt;/o:p&gt;&lt;/b&gt;&lt;/div&gt;\r\n\r\n&lt;div&gt;&lt;!--[if !supportLists]--&gt;&lt;span style=&quot;font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol&quot;&gt;·&lt;span style=&quot;font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &amp;quot;Times New Roman&amp;quot;;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;Provide a platform for undergraduate and\r\ngraduate students for the practical implementation of Electronics Circuits and\r\nProjects. &lt;o:p&gt;&lt;/o:p&gt;&lt;/div&gt;\r\n\r\n&lt;span style=&quot;font-size:11.0pt;line-height:107%;font-family:&amp;quot;Calibri&amp;quot;,sans-serif;\r\nmso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\r\nminor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&amp;quot;Times New Roman&amp;quot;;\r\nmso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-US;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA&quot;&gt;Bring Engineering students to the level of\r\nindustrial standards in the field of Electronics Circuits and Projects.&lt;/span&gt;&lt;/div&gt;', 'S-16', 'Mr. Ajay Dadhich', 'Mr. Kanaram', 'Mrs. Rashmi', 'images/6d4e086_20180906_094728.jpg', 'E', 'Mr. Kanaram'),
(40, 'Control Engineering Lab', '&lt;div&gt;&lt;div&gt;&lt;span style=&quot;font-size:12.0pt;line-height:150%;\r\nfont-family:&amp;quot;Times New Roman&amp;quot;,serif;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;This the laboratory is to impart the practical knowledge about various process control\r\ntechniques used in modern process industries. This laboratory is equipped with\r\nprocess simulation kit with feed forward and cascade control schemes,\r\nelectronic logic controllers, relay logic controllers, level and temperature\r\ncontrol with PID controller, electronic transmitter, recorders, DCS and PLC\r\n(programmable logic controller) trainer kit to carry out advanced experiments\r\nin process control engineering.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/div&gt;\r\n\r\n&lt;div&gt;&lt;b&gt;&lt;span style=&quot;font-size:11.5pt;font-family:\r\n&amp;quot;Times New Roman&amp;quot;,serif;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;border:none windowtext 1.0pt;\r\nmso-border-alt:none windowtext 0in;padding:0in&quot;&gt;Objectives &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/div&gt;\r\n\r\n&lt;div&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:150%;font-family:&amp;quot;Times New Roman&amp;quot;,serif;mso-fareast-font-family:\r\n&amp;quot;Times New Roman&amp;quot;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/div&gt;\r\n\r\n&lt;ul style=&quot;margin-top:0in&quot; type=&quot;disc&quot;&gt;\r\n &lt;ul style=&quot;margin-top:0in&quot; type=&quot;circle&quot;&gt;\r\n  &lt;li class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0in;margin-bottom:.0001pt;\r\n      text-align:justify;line-height:150%;mso-list:l0 level2 lfo1;vertical-align:\r\n      baseline&quot;&gt;&lt;span style=&quot;font-size:12.0pt;line-height:150%;font-family:\r\n      &amp;quot;Times New Roman&amp;quot;,serif;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;To\r\n      help the students understand and practice the modeling, simulation, and\r\n      implementation of a physical dynamical system by linear time-invariant\r\n      ordinary differential equation.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/li&gt;\r\n  &lt;li class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0in;margin-bottom:.0001pt;\r\n      text-align:justify;line-height:150%;mso-list:l0 level2 lfo1;vertical-align:\r\n      baseline&quot;&gt;&lt;span style=&quot;font-size:12.0pt;line-height:150%;font-family:\r\n      &amp;quot;Times New Roman&amp;quot;,serif;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;To\r\n      highlight the electrical modeling of a second order system and analyze\r\n      the under-damped, over-damped and critically damped cases&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/li&gt;\r\n  &lt;li class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0in;margin-bottom:.0001pt;\r\n      text-align:justify;line-height:150%;mso-list:l0 level2 lfo1;vertical-align:\r\n      baseline&quot;&gt;&lt;span style=&quot;font-size:12.0pt;line-height:150%;font-family:\r\n      &amp;quot;Times New Roman&amp;quot;,serif;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;To\r\n      study the effects of poles and zeros location in the s-plane on the\r\n      transient and steady-state behavior&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/li&gt;\r\n  &lt;li class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0in;margin-bottom:.0001pt;\r\n      text-align:justify;line-height:150%;mso-list:l0 level2 lfo1;vertical-align:\r\n      baseline&quot;&gt;&lt;span style=&quot;font-size:12.0pt;line-height:150%;font-family:\r\n      &amp;quot;Times New Roman&amp;quot;,serif;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;To\r\n      study the effects of Lead, Lag and Lag-Lead series compensator on a\r\n      second order system transient and steady state system response.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/li&gt;\r\n &lt;/ul&gt;\r\n&lt;/ul&gt;&lt;/div&gt;', 'F-21', 'Dr H S Mewara', 'Mr. Kanaram', 'Mrs. Anita', 'images/7d34e98_20180906_095415.jpg', 'E', 'Mr. Kanaram'),
(41, 'Instrumentation Workshop', '&lt;div&gt;&lt;div&gt;Aim to\r\nestablish this laboratory is to give basic information to students regarding\r\nidentification and checking of various passive circuit elements. it is also\r\nused to provide a platform for the assembly work, components testing and\r\ntroubleshooting to carry out their projects using the different components and\r\ndevices. The consultancy work can also be done for fault-finding and\r\nrectification of various instruments. This laboratory is equipped with crops,\r\nfunction generators, pulse generators and power supplies to carry out any\r\nexperimental /demonstration work.&lt;o:p&gt;&lt;/o:p&gt;&lt;/div&gt;\r\n\r\n&lt;div&gt;&lt;b&gt;&lt;span style=&quot;font-size:11.5pt&quot;&gt;Objectives&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/div&gt;\r\n\r\n&lt;ul style=&quot;margin-top:0in&quot; type=&quot;disc&quot;&gt;\r\n &lt;li class=&quot;MsoNormal&quot; style=&quot;margin-top: 10.2pt; margin-bottom: 10.2pt; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;span style=&quot;font-size:12.0pt;line-height:150%;font-family:&amp;quot;Times New Roman&amp;quot;,serif;\r\n     mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;identify and understand\r\n     importance of various electrical and electronics components&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/li&gt;\r\n &lt;li class=&quot;MsoNormal&quot; style=&quot;margin-top: 10.2pt; margin-bottom: 10.2pt; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;span style=&quot;font-size:12.0pt;line-height:150%;font-family:&amp;quot;Times New Roman&amp;quot;,serif;\r\n     mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;&quot;&gt;understand basic construction\r\n     and operation of various laboratory equipment’s&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/li&gt;\r\n&lt;/ul&gt;&lt;/div&gt;', 'S-16', 'Dr H S Mewara', 'Mr. Kanaram', 'Mrs. Anita', 'images/abe1f87_20180906_094100.jpg', 'E', 'Mr. Kanaram'),
