INSERT INTO `scholarship` (`id`, `sponsored_by`, `heading`, `detail`, `link`) VALUES
(8, 'Scholarship Program Sponsored in Private by Alumni bodiess', 'Alumni Scholarship only for B. Tech. Girl Students (passing year 2024)', 'Based on merit and financial status of parents of girl student whose passing year is 2024 : Total-20,000/- Rs. Willingness will be made by the sponsoring alumni and approval of principal. Last date for applying 5 November 2023 :', 'https://ecajmer.ac.in/ScholarshipPortal/StudentScholarship/'),
(9, 'Scholarship Program Sponsored in Private by Alumni bodies', 'Scholarship Program supported by Alumni Association ECA', 'Merit and Family financial status based program coordinated with Head of departments of ECA to collate eligible students list who are seeking scholarships and supporting every year based on association aligned budget.', ''),
(10, 'Scholarship Program Sponsored in Private by Alumni bodies', 'Arunoday Chitransh Scholarship, \n<br><br><br><br>\nSponsored by Abhishek Saxena Mechanical Engineering (1997-2001)\n<b>, ECA Ajmer\n<br>(Starting from 2023-24)</b>', 'Based on merit and financial status of parents of <b>students in total 50,000/- Rs every year</b> after the willingness of sponsoring team and approval of principal. \nAim of the Scholarship programs is to provide financial aids to the students of ECA who are intelligent, meritorious but belongs to financially weaker families. This initiative is about giving budding engineers a platform to seek the scholarship and help remove financial impediments in their growth journey.\n<br>', ''),
(11, 'Scholarship Program Sponsored in Private by Alumni bodies', 'ROOP KANWAR SANDWAN JI CHAARAN  (रूपकंवर सांदवण जी चारण ) \nS.E.P. (Scholarship-cum-Encouragement Program)\n<br><br><br>\nSponsored by Bheem Singh Akhawat,\n<b>ECE</b> (2006-10), ECA Ajmer\n<b>\n(Starting from 2024-25)\n</b>', 'Based on merit and financial status of parents of students.\n<b>Total Annual Amount committed by sponsoring Alumni is Rs 25,000/-</b>.  Additionally, Periodic mentorship-cum-career guidance for identified students shall also be provided.\nTotal Amount may be disbursed to single or multiple students depending upon the recommendation from College side.\nStudent should be holding merit as well as in need of Financial Support. Student need to support his/her claim by furnishing Income Certificate as well as ITR (Income Tax Return) of Parent(s).\nStudent should possess Minimum CGPA/Marks as decided/Approved by Principal, ECA Ajmer. \nIn addition to CGPA/Marks, preference may be given to students who are active in extracurricular activities at different Clubs, Cells, Forums, Societies at college or outside. Excellent conduct and behaviour in general at college may bring preference to such students. \nStudent should be regular and full time Student of ECA Ajmer enrolled in B. Tech. course.\nStudent should be in <b>2nd Year or 3rd Year 2024-25 of the B.Tech. ECE course</b>.\nStudent should NOT be availing any other Govt/PSU or Privately Funded Scholarship. An Undertaking in this regard needs to be furnished by student.\n Student should NOT be having any BACK at all (present or in past in any paper/semester).\nStudent should NOT have any Disciplinary/UnFair-Means in Examination related action initiated against him/her. Even initiation of any such action will result in loss of eligibility for applying.\n Any other term and condition as deemed appropriate by Principal ECA Ajmer.\nSponsoring Alumni holds discretion to relax any of the above condition(s) in exceptional case if recommended so by Principal ECA Ajmer.\nSponsoring Alumni holds discretion to relax any of the above condition(s) in exceptional case if deemed appropriate so by himself.\n<br>', ''),
