(34, 'Scholarship Program Sponsored in Private by Alumni bodies', 'Arundeep Competent Engineer Readiness (ACER) program, an initiative in loving memory of Late Smt. Arunabala Saxena, \n<br><br><br><br>\nSponsored by Abhishek Saxena Mechanical Engineering (1997-2001)\n<b>, ECA Ajmer<br>(Starting from 2023-24)</b>', 'Based on merit and financial status of parents of <b>students 50,000/- Rs every year and Periodic mentorship</b> for identified students and making them future ready. Willingness will be made by the sponsoring team and approval of principal.\nAim of the Scholarship programs is to provide financial aids to the students of ECA who are intelligent, meritorious but belongs to financially weaker families. This initiative is about giving budding engineers a platform to seek the scholarship and help remove financial impediments in their growth journey.\n<br>\n', '');
INSERT INTO `smadhans` (`id`, `question`, `answer`, `department`) VALUES
(2, 'this is new samadhan', 'this is answer to the new samadhan question', '12'),
(3, 'this is second samadhan question', 'With the academic ambitions and goals, a student carries a lot of problems and issues caused by social pressure and personal dilemma which weaken his intellect freedom and creative sparks. This is how a young budding mind cannot use energy and vigour in the right direction and fails to fulfill his dreams and social responsibilities.\r\n\r\nThe Human Value Cell is committed to solve students’ ongoing problems, personal dilemma and psychological breakdown. It aims at students’ physical wellness and mental fitness, and encourages them to discover what they are capable of.', '12');
